(null,"14853","","290","sitemap","Domov","domov","0","0","homepage","","","2019-02-22 21:30:11","2019-03-14 15:24:43","2019-02-22 21:30:00","0","","<p><span style=\"font-size:16px\">Sme firma, ktor&aacute; programuje <strong>srdcom</strong>, na&scaron;e weby použ&iacute;vaj&uacute; <strong>mili&oacute;ny ľud&iacute;</strong>, na&scaron;&iacute;mi datab&aacute;zami pre&scaron;lo viac ako <strong>2mili&oacute;ny registracii</strong>, odoslali sme viac ako <strong>100tis&iacute;c</strong> newslettrov. Spracovali sme cez <strong>5000 </strong>bankov&yacute;ch transakcii.&nbsp;Vďaka <strong>milion min&uacute;tam </strong>prehrat&yacute;ch videi sme v <strong>mnoh&yacute;ch </strong>dom&aacute;cnostiach spr&iacute;jemnili zimn&eacute; večery a vyčarili sme <strong>nespočetne </strong>veľa &uacute;primn&yacute;ch &uacute;smevov.&nbsp;</span></p>\n\n<p><span style=\"font-size:16px\">Pracujeme s r&ocirc;znymi modern&yacute;mi technol&oacute;giami, ktor&eacute; s&uacute; použ&iacute;van&eacute; vo webovom priemysle. Za t&yacute;mto &uacute;čelom sme vyvinuli vlastn&yacute; redakčn&yacute; syst&eacute;m pod n&aacute;zvom Designdnt. Jadrom tohoto syst&eacute;mu je nami nap&iacute;san&yacute; objektovo orientovan&yacute; framework dnt3. </span></p>\n\n<p><span style=\"font-size:16px\">Z&aacute;kladom syst&eacute;mu bola použ&iacute;vateľsk&aacute; jednoduchosť, r&yacute;chlosť a v neposlednom rade intuit&iacute;vnosť. Cel&eacute; CMS sme zjednotli a vyvinuli mulifonkčn&uacute; platformu, pod ktorou vieme vivin&uacute;ť naozaj čokoľvek. </span></p>\n\n<p><span style=\"font-size:16px\">Vďaka dlhodob&eacute;mu v&yacute;voju sa n&aacute;m podarilo vypracovať presne to, čo je perfektn&yacute;m z&aacute;kladom pre weby, webov&eacute; aplik&aacute;cie a informačn&eacute; syst&eacute;my.</span></p>\n\n<p><span style=\"font-size:16px\">Nadobudli sme veľa sk&uacute;senost&iacute; z komerčn&yacute;ch firiem, ako napr&iacute;klad Triad, PS Digital, Tv Mark&iacute;za, eFabria, Comsultia. Taktiež sme veľa inform&aacute;cii a produktov do t&yacute;chto firiem vložili. Napr&iacute;klad v TV Mark&iacute;za sme vyv&yacute;jali kompletn&yacute; web. </span></p>\n\n<p><span style=\"font-size:16px\">Proces developmentu sme &scaron;tandardizovali podľa bežn&yacute;ch firem&yacute;ch &scaron;trukt&uacute;r. Pri developmente použ&iacute;vame n&aacute;stroje ako <strong>Git</strong>, <strong>Gulp</strong>, <strong>Apache</strong>, <strong>Linux</strong>, <strong>Bamboo</strong>, <strong>MantisBT</strong></span></p>\n\n<ol>\n	<li><span style=\"font-size:16px\">Multidom&eacute;nov&aacute; a multiwebov&aacute; platforma</span></li>\n	<li><span style=\"font-size:16px\">R&ocirc;zny počet presmerovan&iacute;</span></li>\n	<li><span style=\"font-size:16px\">Neobmedzen&yacute; multilanguage</span></li>\n	<li><span style=\"font-size:16px\">Neobmedzen&yacute; počet str&aacute;nok a podstr&aacute;nok</span></li>\n	<li><span style=\"font-size:16px\">Modulov&aacute; &scaron;trukt&uacute;ra</span></li>\n	<li><span style=\"font-size:16px\">OOP n&aacute;vrh</span></li>\n	<li><span style=\"font-size:16px\">API interface</span></li>\n	<li><span style=\"font-size:16px\">inteligentn&eacute;&nbsp;URL adresy s chronologickou postupnosťou</span></li>\n	<li><span style=\"font-size:16px\">autoredirector</span></li>\n	<li><span style=\"font-size:16px\">vlastn&eacute; media library</span></li>\n	<li><span style=\"font-size:16px\">content manager</span></li>\n	<li><span style=\"font-size:16px\">analysis manager</span></li>\n</ol>\n\n<p><span style=\"font-size:16px\">Po dobu viac ako 6 rokov sa neust&aacute;le venujeme jedn&eacute;mu produktu a t&yacute;m je na&scaron;a platforma. Platforma, ktor&aacute; je nap&iacute;san&aacute; tak, aby pom&aacute;hala ľuďom.</span></p>\n\n<p><span style=\"font-size:16px\">Made by heart, developed by skills.</span></p>\n","","","","","10","2","","0","58","0"),
(null,"14854","","290","sitemap","Preteky","preteky","0","0","preteky","1105","3296","2019-02-22 21:31:08","2019-03-19 09:40:33","2019-02-22 21:31:00","0","<p>Čo rob&iacute;me?</p>\n","<p>Seri&aacute;l pretekov Župn&yacute; poh&aacute;r 2019 nadv&auml;zuje na predo&scaron;l&yacute;ch sedem &uacute;spe&scaron;n&yacute;ch ročn&iacute;kov zastre&scaron;ovan&yacute;ch Bratislavsk&yacute;m samospr&aacute;vnym krajom. Je to jedinečn&yacute; &scaron;portov&yacute; projekt, ktor&eacute;ho cieľom je nielen dobre si za&scaron;portovať a zas&uacute;ťažiť, ale svojou &uacute;časťou z&aacute;roveň podporiť a propagovať Bratislavsk&yacute; samospr&aacute;vny kraj. Župn&yacute; poh&aacute;r je určen&yacute; pre v&scaron;etk&yacute;ch milovn&iacute;kov cyklistiky, ktor&iacute; maj&uacute; radi akt&iacute;vny životn&yacute; &scaron;t&yacute;l a chc&uacute; niečo urobiť pre seba i pre in&yacute;ch.</p>\n","","","","","9","1","","0","58","0"),
(null,"14856","","290","sitemap","Propozície","propozicie","0","0","singl_page","","3459","2019-02-22 21:54:53","2019-03-16 13:15:56","2019-02-22 21:54:00","0","","<p style=\"text-align:start\"><span style=\"background-color:transparent; font-size:13px\">Do celkov&eacute;ho poradia v Župnom poh&aacute;ri sa bude poč&iacute;tať&nbsp;<strong>p&auml;ť najlep&scaron;&iacute;ch&nbsp;v&yacute;sledky z&nbsp;&ocirc;smich&nbsp;</strong>(bodovo) možn&yacute;ch.<br />\nBodovanie prebieha samostatne v každ&yacute;ch pretekoch a zarat&uacute;va sa do celkov&yacute;ch v&yacute;sledkov podľa kateg&oacute;ri&iacute;.<br />\nNajr&yacute;chlej&scaron;&iacute; pretek&aacute;r (celkovo) na podujat&iacute; z&iacute;skava nasledovn&eacute; body:<br />\n<strong>Marat&oacute;n</strong>: super dlh&aacute; 1600 (Stupava 105km), dlh&aacute; trať 1300, stredn&aacute; trať 1000, kr&aacute;tka trať 700&nbsp;</span><br />\n<strong><span style=\"color:rgb(29, 33, 41); font-family:helvetica,sans-serif; font-size:14px\">Zimn&yacute; marat&oacute;n</span></strong>: 1000<br />\n<span style=\"background-color:transparent; font-size:13px\"><strong>Časovka</strong>: 1000</span><br />\n<span style=\"font-family:arial,sans-serif; font-size:14px\"><strong>Cross country</strong>: 1000 elite (odstupňovan&eacute; podľa počtu okruhov pre kateg&oacute;riu)</span><br />\n<span style=\"font-family:arial,sans-serif; font-size:14px\">Ostatn&iacute; pretek&aacute;ri a pretek&aacute;rky z&iacute;skavaj&uacute; body v z&aacute;vislosti od dosiahnut&eacute;ho času podľa vzorca:&nbsp;</span></p>\n\n<p style=\"text-align:start\"><em><span style=\"background-color:transparent; font-size:13px\">Bn = 1000 x (3 &ndash; Tn/T1) / 2;&nbsp;</span></em></p>\n\n<p><span style=\"background-color:rgb(255, 255, 255); color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">kde: Bn ...body n-t&eacute;ho, Tn ...čas n-t&eacute;ho, T1 ...čas v&iacute;ťaza.&nbsp;</span><br />\n<br />\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Vzorec je nastaven&yacute; tak, aby do celkov&eacute;ho hodnotenia z&iacute;skal body každ&yacute; pretek&aacute;r, ktor&yacute; pr&iacute;de do cieľa najnesk&ocirc;r v trojn&aacute;sobnom čase ako v&iacute;ťaz.&nbsp;</span><br />\n<br />\n<!--<span style=\"background-color:rgb(255, 255, 255); color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Učastnící aspoň piatich pretekov zo šiestich dostanú dres</span><br />\n<br />--> <strong>Kateg&oacute;rie hodnoten&eacute; v Župnom poh&aacute;ri 2018:</strong><br />\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Muži 19-39 r.</span><br />\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Seniori 40-49 r.</span><br />\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Veter&aacute;ni 50-59 r.</span><br />\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Veter&aacute;ni 60 a viac r.</span><br />\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Ženy 19-39 r.</span><br />\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Ženy 40-49 r.</span><br />\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Ženy 50 a viac r.</span><br />\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Juniori 17-18 r.</span><br />\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Juniorky 17-18 r.</span><br />\n<span style=\"background-color:rgb(255, 255, 255); color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Kadeti 15-16 r.<br />\nKadetky 15-16 r.</span></p>\n\n<p>&nbsp;</p>\n","","","","","8","1","","0","58","0"),
