\n<p>&nbsp;</p>\n\n<h1>Kaktus Bike Karlovesk&yacute; kros</h1>\n\n<p>&nbsp;</p>\n\n<h2>Cross-country preteky v horskej cyklistike &ndash; 2 kolo Župn&eacute;ho poh&aacute;ra 2016</h2>\n\n<p>&nbsp;</p>\n\n<table cellpadding=\"0\" cellspacing=\"0\" style=\"height:77px; width:1463px\">\n	<tbody>\n		<tr>\n			<td><strong>Usporiadateľ</strong></td>\n			<td>KAKTUS BIKE - Team Bratislava.</td>\n		</tr>\n		<tr>\n			<td><strong>D&aacute;tum pretekov</strong></td>\n			<td>21. m&aacute;j 2016</td>\n		</tr>\n		<tr>\n			<td><strong>Miesto konania:</strong></td>\n			<td>Park SNP - L&iacute;&scaron;čie &uacute;dolie (841 04 Karlova Ves; Bratislava)</td>\n		</tr>\n		<tr>\n			<td><strong>GPS s&uacute;radnice</strong></td>\n			<td>48&deg;09&acute;45.0&acute;&acute;N; 17&deg;03&acute;15,9&acute;&acute;E.</td>\n		</tr>\n		<tr>\n			<td><strong>Parkovisko pretekov</strong></td>\n			<td>Pod &scaron;portov&yacute;m komplexom IUVENTA cca 300m od miesta &scaron;tartu (Karlovesk&aacute; 2951/62; 841 04 Karlova Ves; Bratislava).</td>\n		</tr>\n		<tr>\n			<td><strong>Kancel&aacute;ria pretekov<br />\n			(registr&aacute;cia pretek&aacute;rov):</strong></td>\n			<td>V mieste &scaron;tartu/cieľa (Park SNP - L&iacute;&scaron;čie &uacute;dolie) &ndash; rozhodcovsk&yacute; stan Kaktus Bike.</td>\n		</tr>\n		<tr>\n			<td><strong>Riaditeľ pretekov</strong></td>\n			<td>Martin Bel&aacute;s.</td>\n		</tr>\n		<tr>\n			<td><strong>Hlavn&yacute; rozhodca</strong></td>\n			<td>Pavol Miazdra.</td>\n		</tr>\n		<tr>\n			<td><strong>Traťov&yacute; komis&aacute;r</strong></td>\n			<td>Juraj Vrbik.</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<h3>Registr&aacute;cia/prezent&aacute;cia pretek&aacute;rov a časov&yacute; rozpis pretekov:</h3>\n\n<p>Online registr&aacute;cia je možn&aacute; na <a href=\"http://biketeam.sk/prihlaska-karlovesky-kros\" target=\"\" title=\"\">www.biketeam.sk</a> od 25. 04. 2016 do 19. 05. 2016 do 20:00 hod.<br />\nRegistr&aacute;ciou cez internet ur&yacute;chlite svoju prezent&aacute;ciu v kancel&aacute;rii pretekov a uľahč&iacute;te pr&aacute;cu organiz&aacute;torom pretekov (platba je až pri prezent&aacute;cii v kancel&aacute;ri&iacute; pretekov).</p>\n\n<p><strong>21. m&aacute;j 2016</strong><br />\n11:00 &ndash; 14:00&nbsp;&nbsp;&nbsp;&nbsp; registr&aacute;cia/prezent&aacute;cia pretek&aacute;rov v&scaron;etk&yacute;ch kateg&oacute;ri&iacute; (v mieste kancel&aacute;rie pretekov; Park SNP - L&iacute;&scaron;čie &uacute;dolie; rozhodcovsk&yacute; stan Kaktus Bike).<br />\n14:30 &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &scaron;tart pretekov pre kateg&oacute;rie: KADETOV, KADETIEK, MUŽOV 40-49 r., MUŽOV 50-59 r., MUŽOV 60 a nad 60 rokov, ŽIEN 19-39 r., ŽIEN 40-49 r. a ŽIEN 50 a nad 50 rokov,<br />\n15:30&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &scaron;tart pretekov pre kateg&oacute;rie: JUNIOROV, JUNIORIEK a MUŽOV 19-39 rokov,<br />\n17:30&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ODOVZD&Aacute;VANIE CIEN V&Iacute;ŤAZOM VO V&Scaron;ETK&Yacute;CH KATEG&Oacute;RI&Aacute;CH.</p>\n\n<p>&nbsp;</p>\n\n<h3>&Scaron;tartovn&eacute;:</h3>\n\n<p>7,-&euro; pre v&scaron;etky kateg&oacute;rie.<br />\nV cene &scaron;tartovn&eacute;ho je: &scaron;tartovn&eacute; č&iacute;slo, občerstvenie (tepl&eacute; jedlo a n&aacute;poj) a zaradenie do z&aacute;verečnej tomboly (v pr&iacute;pade, že sa pretek&aacute;r z&uacute;častnil minim&aacute;lne 5 pretekov Župn&eacute;ho poh&aacute;ra 2016). &Scaron;tartovn&eacute; sa plat&iacute; na mieste registr&aacute;cie.</p>\n\n<p>&nbsp;</p>\n\n<h3>Dĺžky pretekov a vekov&eacute; kateg&oacute;rie (roky naroden&iacute;):</h3>\n\n<p><strong>KADETI </strong>(2000 a 2001) 2x veľk&yacute; okruh,<br />\n<strong>KADETKY </strong>(2000 a 2001) 1x veľk&yacute; okruh,<br />\n<strong>JUNIORI </strong>(1998 a 1999) 3x veľk&yacute; okruh,<br />\n<strong>JUNIORKY </strong>(1998 a 1999) 2x veľk&yacute; okruh,<br />\n<strong>MUŽI </strong>19-39 r. (1977 až 1997) 4x veľk&yacute; okruh,<br />\n<strong>MUŽI </strong>40-49 r. (1967 až 1976) 3x veľk&yacute; okruh,<br />\n<strong>MUŽI </strong>50-59 r. (1957 až 1966) 2x veľk&yacute; okruh,<br />\n<strong>MUŽI </strong>60 a nad 60 r. (1956 a star&scaron;&iacute;) 2x veľk&yacute; okruh,<br />\n<strong>ŽENY </strong>19-39 r. (1977 až 1997) 2x veľk&yacute; okruh,<br />\n<strong>ŽENY </strong>40-49 r. (1967 až 1976) 1x veľk&yacute; okruh,<br />\n<strong>ŽENY </strong>50 a nad 50 r. (1966 a star&scaron;ie) 1x veľk&yacute; okruh.</p>\n\n<p>&nbsp;</p>\n\n<h3>Dĺžka okruhu:</h3>\n\n<p>5200 m s 260 m prev&yacute;&scaron;en&iacute;m.<br />\nDĺžka pretekov je orientačn&aacute;, konečn&yacute; počet okruhov urč&iacute; rozhodcovsk&yacute; zbor v deň pretekov.</p>\n\n<p>&nbsp;</p>\n\n<h3>Ceny:</h3>\n\n<p>Prv&iacute; traja pretek&aacute;ri/pretek&aacute;rky v každej kateg&oacute;ri&iacute; z&iacute;skaj&uacute; vecn&eacute; ceny.</p>\n\n<p>&nbsp;</p>\n\n<h3>&Scaron;portovo &ndash; technick&eacute; ustanovenia:</h3>\n\n<p>Pretek&aacute; sa podľa platn&yacute;ch pravidiel Slovensk&eacute;ho zv&auml;zu cyklistiky (SZC) a medzin&aacute;rodnej cyklistickej &uacute;nie (UCI) pre rok 2016. V dĺžke cel&eacute;ho okruhu je povolen&eacute; pod&aacute;vať občerstvenie a poskytn&uacute;ť technick&uacute; pomoc.<br />\nKažd&yacute; pretek&aacute;r &scaron;tartuje na vlastn&uacute; zodpovednosť. Každ&yacute; pretek&aacute;r mus&iacute; byť poisten&yacute;. &Uacute;častn&iacute;ci pretekov s&uacute; povinn&iacute; dodržiavať pokyny usporiadateľa, pokyny pol&iacute;cie a rozhodcov. Organiz&aacute;tor nezodpoved&aacute; za &scaron;kody &uacute;častn&iacute;kom pretekov vzniknut&eacute; ani nimi sp&ocirc;soben&eacute;, neruč&iacute; za &scaron;kody sp&ocirc;soben&eacute; treťou osobou na majetku, zdrav&iacute;, ako aj &scaron;kody sp&ocirc;soben&eacute; pretek&aacute;rom a doprovodom tret&iacute;m osob&aacute;m a subjektom.<br />\nCyklistick&yacute; prilba umiestnen&aacute; na hlave a zapnut&aacute; je povinn&aacute; počas cel&yacute;ch pretekov!<br />\nTrasa pretekov vedie verejn&yacute;mi mestsk&yacute;mi lesmi, preto buďte aj počas pretekov ohľadupln&iacute; k pr&iacute;rode a jej n&aacute;v&scaron;tevn&iacute;kom!<br />\nInform&aacute;cie: <a href=\"mailto:martin.belas@uniba.sk\" target=\"_blank\" title=\"\">martin.belas@uniba.sk</a>, <a href=\"http://www.biketeam.sk\" target=\"_blank\" title=\"\">www.biketeam.sk</a></p>\n\n<p>&nbsp;</p>\n\n<p>V Bratislave 20.04.2016</p>\n\n<p>Martin Bel&aacute;s,<br />\nriaditeľ pretekov.</p>\n\n<h2>&nbsp;</h2>\n</div>\n","","","","","0","1","","0","58","0"),
(null,"15232","","1044","post","Prejazd Kaktusbike Bratislavského MTB maratónu 2015","prejazd-kaktusbike-bratislavskeho-mtb-maratonu-2015","0","0","","","3661","2019-03-18 15:26:55","2019-03-18 15:26:55","2015-06-11 11:00:00","0","","<p>Včera, 10.6.2015 som bol prejsť cel&yacute; &uacute;sek <strong>Kaktusbike Bratislavsk&eacute;ho MTB marat&oacute;nu</strong>. Rozhodol som sa tak spraviť z&nbsp;dvoch d&ocirc;vodov.</p>\n\n<ol>\n	<li>Potreboval som zistiť, v&nbsp;akom stave je trať</li>\n	<li>Chcel som si ju &bdquo;najazdiť&ldquo;, aby som v&nbsp;preteku nemusel rie&scaron;iť, kadiaľ.</li>\n</ol>\n\n<p>Vcelku ma prekvapila r&yacute;chlosť okruhu, nečakal som, že po zmen&aacute;ch bude až tak&yacute; r&yacute;chly, podot&yacute;ka, že som ne&scaron;iel pomaly, ale zase boli &uacute;seky, čo som &bdquo;oddychoval&ldquo;.<br />\nVeľmi ma pote&scaron;il pridan&yacute; &uacute;sek nad Dev&iacute;nom,&nbsp; je tam viac nast&uacute;pan&yacute;ch v&yacute;&scaron;kov&yacute;ch metrov, ale prech&aacute;dza sa celkom pekn&yacute;mi &uacute;sekmi a&nbsp;ako dom&aacute;cu, čo Kobylu pozn&aacute; som sa chv&iacute;ľami nechal zl&aacute;kať v&yacute;hľadmi, rsp sk&ocirc;r pohľadmi na krajinu. Taktiež ma pote&scaron;il pridan&yacute; &bdquo;terasov&yacute; &ldquo; &uacute;sek nad Dev&iacute;nom. Jedn&aacute; sa o&nbsp;umelo spraven&yacute; &uacute;sek &nbsp;v&nbsp;tr&aacute;ve a&nbsp;je fajn na vyladenie z&nbsp;tempa. Zo z&aacute;vodn&eacute;ho hľadiska viem povedať, že ak sa tam bude nach&aacute;dzať pretek&aacute;r s&nbsp;n&aacute;skokom cca min&uacute;ty, nebude ho probl&eacute;m stiahnuť, je to tak&aacute; kv&aacute;zi XC vychyt&aacute;vka.</p>\n\n<p>Ďal&scaron;ie nast&uacute;pen&eacute; metre pribudli na obchvate kobyly, kedy sa začne po zelenej značke st&uacute;pať priamo pod vrchol &ndash; zab&iacute;jačke st&uacute;panie :D Na r&aacute;zcest&iacute; s&nbsp;červenou značkou sa ide doľava po vrstevnici a&nbsp;n&aacute;sledne doľava sa zozjazduje na skoro totožn&eacute; miesto, odkiaľ sa &scaron;lo hore. Ďalej sa pokračuje po klasickom obchvate.... St&uacute;panie k&nbsp;Salezu chalani zmenili, nejde sa po &uacute;seku, ktor&yacute; sa tlačil, ale ide sa &bdquo;&uacute;vozom&ldquo; po ľavej strane. Tento &bdquo;&uacute;voz&ldquo; je umelo vytvoren&yacute; pr&aacute;ve ako obchvat. Je perfektne vysekan&yacute;, &scaron;irok&yacute; a&nbsp;hľadk&yacute; -&gt; r&yacute;chle st&uacute;panie. Od občerstvovačky je to zase klasika, s&nbsp;t&yacute;m, že sa st&uacute;pa pod vrchol Kobyly, zmena nast&aacute;va na vrstevnici pod Vojensk&yacute;m objektom, tu je novinka v&nbsp;podobe vjazdu do samotn&eacute;ho objektu a&nbsp;t&yacute;mto objektom sa vyjde až na najvy&scaron;&scaron;&iacute; bod &ndash; Dev&iacute;nsku Kobylu (515m.n.m) . Dolu sa z&iacute;de paralelnou asfaltkou. Ide sa po asfaltke von z&nbsp;objektu a&nbsp;pokračuje sa p&ocirc;vodnou trasou okruhu až do cieľa.<br />\n<br />\nOkruh je oproti minul&eacute;mu roku dlh&scaron;&iacute;, ale určite vylep&scaron;en&yacute;. Ja osobne m&aacute;m r&aacute;d tak&yacute;to hrav&yacute; ter&eacute;n. Technicky nie je n&aacute;ročn&yacute;, sk&ocirc;r fyzicky, veľa kr&aacute;tkych a&nbsp;r&yacute;chlych st&uacute;pan&iacute;, ktor&eacute; sa daj&uacute; &bdquo;vydupať&ldquo; zo sedla. V&nbsp;cieli bude mať asi každ&yacute; dosť.</p>\n\n<p><strong>Pre info<em>:</em></strong><em> Podľa tachometra som mal <strong>42,64km</strong> a&nbsp;trvalo mi to <strong>2:07:36</strong> -&gt; priemern&aacute; r&yacute;chlosť <strong>20,05km/h</strong>. M&ocirc;j odhad je, že v&iacute;ťaz by to mohol &iacute;sť tesne pod 2 hodiny.</em></p>\n\n<p><em><img alt=\"\" src=\"http://www.bratislavskymtbmaraton.sk/typo3temp/pics/0eec807366.jpg\" style=\"height:87px; width:485px\" /></em></p>\n\n<p><span style=\"color:rgb(85, 85, 85); font-family:verdana,sans-serif; font-size:9pt\">Marat&oacute;n bude s&uacute;časťou nasleduj&uacute;cich s&eacute;ri&iacute;:<br />\n-&nbsp;</span><a href=\"http://www.cyklomaraton.sk/\" style=\"margin: 0px; padding: 0px; border: 0px; font-weight: bold; font-family: Arial, Tahoma, sans-serif; vertical-align: baseline; color: rgb(112, 159, 29); text-decoration: none; line-height: normal;\" target=\"_blank\"><strong><span style=\"color:rgb(28, 110, 160); font-family:verdana,sans-serif; font-size:9pt\">Slovak XCM Tour</span><span style=\"font-family:verdana,sans-serif; font-size:9pt\">&nbsp;</span></strong></a><span style=\"color:rgb(85, 85, 85); font-family:verdana,sans-serif; font-size:9pt\">- medzin&aacute;rodn&aacute; s&eacute;ria MTB marat&oacute;nov<br />\n<strong>-&nbsp;</strong></span><a href=\"http://www.zupnypohar.sk/index.php?src=vitajte\" style=\"margin: 0px; padding: 0px; border: 0px; font-weight: bold; font-family: Arial, Tahoma, sans-serif; vertical-align: baseline; color: rgb(112, 159, 29); text-decoration: none; line-height: normal;\" target=\"_blank\"><strong><span style=\"font-family:verdana,sans-serif; font-size:9pt\">Župn&yacute; poh&aacute;r</span></strong></a><strong><span style=\"color:rgb(85, 85, 85); font-family:verdana,sans-serif; font-size:9pt\">&nbsp;-</span></strong><span style=\"color:rgb(85, 85, 85); font-family:verdana,sans-serif; font-size:9pt\">&nbsp;s&eacute;ria pretekov v bratislavskom kraji<br />\n-&nbsp;<strong>Slovensk&yacute; poh&aacute;r</strong>&nbsp;- pre pretek&aacute;rov s licenciou SZC - 4.kolo</span><span style=\"color:rgb(30, 30, 30); font-family:verdana,sans-serif; font-size:9pt\">.</span></p>\n\n<p><em><strong>WEB:</strong>&nbsp;<a href=\"http://www.bratislavskymtbmaraton.sk/\" target=\"_blank\">http://www.bratislavskymtbmaraton.sk/</a></em><br />\n<em><strong>GPS:</strong>&nbsp;</em><a href=\"http://www.bratislavskymtbmaraton.sk/fileadmin/bratislavskymtbmaraton/user_uploads/activity_789227077.gpx\" target=\"_blank\">http://www.bratislavskymtbmaraton.sk/fileadmin/bratislavskymtbmaraton/user_uploads/activity_789227077.gpx</a><br />\n<strong>Propoz&iacute;cie:</strong>&nbsp;<a href=\"http://www.bratislavskymtbmaraton.sk/propozicie/\" target=\"_blank\">http://www.bratislavskymtbmaraton.sk/propozicie/​</a><br />\n<strong>Prihl&aacute;senie:&nbsp;</strong><a href=\"http://www.cyklo.sao-tatry.sk/2015/preteky/bratislavsky/index.php?l=sk\" target=\"_blank\">http://www.cyklo.sao-tatry.sk/2015/preteky/bratislavsky/index.php?l=sk​</a></p>\n\n<p><strong>Detsk&eacute; preteky:<br />\n<img alt=\"\" src=\"http://www.bratislavskymtbmaraton.sk/typo3temp/pics/9adc30fc98.jpg\" style=\"height:439px; width:620px\" /></strong></p>\n\n<p>Te&scaron;&iacute;me sa na V&aacute;s 13.6.2015 na novom vylep&scaron;enom okruhu KaktusBike Bratislavsk&eacute;ho MTB marat&oacute;nu!<br />\n<br />\n<em>Jo a&nbsp;večer je v&nbsp;Senci Seneck&eacute; leto 2015 :D</em></p>\n","","","","","0","1","","0","58","0"),
(null,"15233","","1044","post","3.kolo Župného Pohára 2015 už o 9 dní","3-kolo-zupneho-pohara-2015-uz-o-9-dni","0","0","","","3662","2019-03-18 15:26:55","2019-03-18 15:26:55","2015-06-04 11:00:00","0","","<h2>Kaktusbike Bratislavsk&yacute; MTB marat&oacute;n sa bl&iacute;ži - 3.kolo Župn&eacute;ho Poh&aacute;ra.</h2>\n\n<p>Prihlasovanie:&nbsp;http://bit.ly/1IfAVqn<br />\nMTBiker f&oacute;rum:&nbsp;http://bit.ly/1GmbHca<br />\nOficial&nbsp;str&aacute;nka:&nbsp;http://bit.ly/1cz8zvM</p>\n\n<h3>SLEDOVAN&Iacute;M NA&Scaron;EJ STR&Aacute;NKY</h3>\n\n<p><a href=\"http://www.bratislavskymtbmaraton.sk\" target=\"_blank\">www.bratislavskymtbmaraton.sk&nbsp;</a><br />\nalebo na Facebooku&nbsp;<br />\n<a href=\"https://www.facebook.com/zupnypohar\" target=\"_blank\">www.facebook.com/zupnypohar&nbsp;</a><br />\nsa dozviete viac.&nbsp;</p>\n\n<p><strong>Dĺžky trat&iacute;&nbsp;</strong></p>\n\n<p>dlh&aacute; &ndash; dĺžka 70 km / prev&yacute;&scaron;enie 2400 m&nbsp;<br />\nstredn&aacute; &ndash; dĺžka 40 km / prev&yacute;&scaron;enie 1300 m&nbsp;<br />\nkr&aacute;tka &ndash; dĺžka 22 km / prev&yacute;&scaron;enie 700 m&nbsp;</p>\n\n<p><strong>Občerstvenie na trati&nbsp;</strong><br />\nkr&aacute;tka trať (1x)&nbsp;<br />\nstredn&aacute; trať (2x)&nbsp;<br />\ndlh&aacute; trať (4x)<br />\nGPX prejazdu trate: <a href=\"http://www.bratislavskymtbmaraton.sk/fileadmin/bratislavskymtbmaraton/user_uploads/activity_789227077.gpx\" target=\"_blank\">STIAHNUŤ&nbsp;</a><br />\nStredn&aacute; trasa, ktor&aacute; je na gpx, bude e&scaron;te čiastočne upraven&aacute; v časti Dev&iacute;na, kde bol bufet. Ten sa pres&uacute;va na cestu pri v&yacute;jazde z vinohradov v Dev&iacute;ne (ulica K zlat&eacute;mu rohu). Preto sa p&ocirc;jde pri zjazde k p&ocirc;vodn&eacute;mu miestu bufeta rovno od bet&oacute;novej plochy vo vinohradoch po najvy&scaron;&scaron;ej terase sp&auml;ť do vinohradov. Cel&aacute; t&aacute;to časť trasy je vykosen&aacute;, d&aacute; sa vysk&uacute;&scaron;ať. Od betńovej plochy hore na najvy&scaron;&scaron;iu terasu vedie vykosen&aacute; trasa.&nbsp;<br />\nStredn&aacute; trať m&aacute; 40km a prev&yacute;&scaron;enie 1326m.Zakomponovan&eacute; zmeny oproti vlaňaj&scaron;ej trasy s&uacute; oživen&iacute;m pretekov. Je to vlastne okruh, ktor&yacute; sa na dlhej trase p&ocirc;jde 2x (okrem n&aacute;jazdu od &scaron;tartu) s prev&yacute;&scaron;en&iacute;m viac ako 2000m, to už bude vyžadovať od bikerov veľmi slu&scaron;n&uacute; kondičku.</p>\n\n<h2>PRIPRAVEN&Eacute; TRASY</h2>\n\n<p><a href=\"https://www.google.com/maps/d/viewer?mid=zU0DHRE0Oc4o.kB2fJxdo-16w&amp;usp=sharing\" target=\"_blank\">https://www.google.com/maps/d/viewer?mid=zU0DHRE0Oc4o.kB2fJxdo-16w&amp;usp=sharing</a><br />\n<strong>Zelen&eacute; časti s&uacute; pre kr&aacute;tku trať.</strong><br />\n<strong>Najdlh&scaron;ia p&ocirc;jde dve kol&aacute;.</strong><br />\n<em>M&ocirc;že e&scaron;te pr&iacute;sť k mal&yacute;m &uacute;prav&aacute;m.</em></p>\n\n<p><strong>22 KM - KR&Aacute;TKA TRAŤ</strong><br />\nKr&aacute;tka trať je určen&aacute; pre hob&iacute;kov, alebo v&iacute;kendov&yacute;ch bajkerov, ktor&iacute; s bajkovan&iacute;m e&scaron;te len zač&iacute;naj&uacute;, alebo sa chc&uacute; v kľude pokochať pr&iacute;rodou&nbsp;<br />\nKr&aacute;tka trať je skoro tak&aacute; ist&aacute; ako vlani a predvlani. Rozdiel je len pri prejazde bufetom v Dev&iacute;ne</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n","","","","","0","1","","0","58","0"),
(null,"15234","","1044","post","Propozície Kaktus Bike Karloveský kros 2015","propozicie-kaktus-bike-karlovesky-kros-2015","0","0","","","3663","2019-03-18 15:26:55","2019-03-18 15:26:55","2015-04-28 11:00:00","0","","<p style=\"text-align:center\"><strong><span style=\"font-size:24.0pt\">Kaktus Bike Karlovesk&yacute; kros </span></strong></p>\n\n<p style=\"margin-left:36.0pt; text-align:center\"><strong>&nbsp;</strong></p>\n\n<p style=\"text-align:center\"><strong><span style=\"font-size:16.0pt\">Cross-country preteky v&nbsp;horskej cyklistike &ndash; 2 kolo Župn&eacute;ho poh&aacute;ra 2015</span></strong></p>\n\n<p style=\"margin-left:36.0pt; text-align:center\"><strong>&nbsp;</strong></p>\n\n<p>&nbsp;</p>\n\n<p style=\"text-align:justify\"><strong>Usporiadateľ: </strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kaktus &ndash; Bike team Bratislava.</p>\n\n<p style=\"text-align:justify\"><strong>D&aacute;tum pretekov:</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 24. m&aacute;j &nbsp;2015.</p>\n\n<p style=\"text-align:justify\"><strong>Miesto konania:</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"color:black\">Park SNP - L&iacute;&scaron;čie &uacute;dolie (841 04 Karlova Ves; Bratislava)</span></p>\n\n<p style=\"text-align:justify\"><span style=\"color:black\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; GPS s&uacute;radnice: 48&deg;09&acute;45.0&acute;&acute;N; 17&deg;03&acute;15,9&acute;&acute;E.</span></p>\n\n<p style=\"text-align:justify\"><strong><span style=\"color:black\">Parkovisko pretekov:</span></strong><span style=\"color:black\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pod &scaron;portov&yacute;m komplexom IUVENTA cca 300m od miesta &scaron;tartu &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (Karlovesk&aacute; 2951/62; 841 04 Karlova Ves; Bratislava).</span></p>\n\n<p style=\"text-align:justify\"><strong>Kancel&aacute;ria pretekov </strong></p>\n\n<p style=\"text-align:justify\"><strong>(registr&aacute;cia pretek&aacute;rov):</strong> &nbsp;&nbsp;&nbsp;&nbsp; V&nbsp;mieste &scaron;tartu/cieľa (<span style=\"color:black\">Park SNP - L&iacute;&scaron;čie &uacute;dolie)</span> &ndash; rozhodcovsk&yacute; stan &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Kaktus Bike.</strong></p>\n\n<p style=\"text-align:justify\"><strong>Riaditeľ pretekov:&nbsp; </strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Martin Bel&aacute;s.</p>\n\n<p style=\"text-align:justify\"><strong>Hlavn&yacute; rozhodca:</strong>&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pavol Miazdra.</p>\n\n<p style=\"text-align:justify\"><strong>Traťov&yacute; komis&aacute;r:</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Michal Straka.</p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p style=\"text-align:justify\"><strong><span style=\"font-size:16.0pt\">Registr&aacute;cia/prezent&aacute;cia pretek&aacute;rov a časov&yacute; rozpis pretekov: </span></strong></p>\n\n<p style=\"text-align:justify\"><strong>Online registr&aacute;cia</strong> je možn&aacute; na <a href=\"http://biketeam.sk/prihlaska-karlovesky-kros\"> www.biketeam.sk</a> od 27. 04. 2015 do 21. 05. 2015 do 20:00 hod. Registr&aacute;ciou cez internet ur&yacute;chlite svoju prezent&aacute;ciu v&nbsp;kancel&aacute;rii pretekov a&nbsp;uľahč&iacute;te pr&aacute;cu organiz&aacute;torom pretekov (platba je až pri prezent&aacute;cii v&nbsp;kancel&aacute;ri&iacute; pretekov).</p>\n\n<p style=\"text-align:justify\"><strong>&nbsp;</strong></p>\n\n<p style=\"text-align:justify\"><strong>23. m&aacute;j 2015</strong></p>\n\n<p style=\"text-align:justify\"><strong>&nbsp;</strong></p>\n\n<p style=\"text-align:justify\">16:00 &ndash; 21:00 registr&aacute;cia/prezent&aacute;cia pretek&aacute;rov v&scaron;etk&yacute;ch kateg&oacute;ri&iacute; (v mieste kancel&aacute;rie pretekov; <span style=\"color:black\">Park SNP - L&iacute;&scaron;čie &uacute;dolie; </span> rozhodcovsk&yacute; stan <strong>Kaktus Bike</strong>).</p>\n\n<p style=\"text-align:justify\"><strong>&nbsp;</strong></p>\n\n<p style=\"text-align:justify\"><strong>24. m&aacute;j 2015 </strong> (registr&aacute;cia/prezent&aacute;cia pretek&aacute;rov):</p>\n\n<p style=\"text-align:justify\"><strong>&nbsp;</strong></p>\n\n<p style=\"text-align:justify\">8:00 &ndash; 9:30&nbsp;&nbsp;&nbsp; registr&aacute;cia/prezent&aacute;cia pretek&aacute;rov nasledovn&yacute;ch kateg&oacute;ri&iacute;:<strong>&nbsp;&nbsp; juniori, juniorky, &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; muži </strong>40-49 r.,<strong> muži </strong>50-59 r.,<strong>&nbsp;muži </strong>60 a<strong> </strong>nad 60 rokov, <strong> ženy </strong>19-39 r.,<strong> ženy </strong>40-&nbsp; 49 r. a<strong>&nbsp;ženy </strong>50 a nad 50 rokov,&nbsp;</p>\n\n<p style=\"text-align:justify\">&nbsp;8:00 &ndash; 11:00&nbsp; registr&aacute;cia/prezent&aacute;cia pretek&aacute;rov nasledovn&yacute;ch kateg&oacute;ri&iacute;: <strong> mini</strong> chlapci a&nbsp;<strong>mini</strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; dievčat&aacute;,</p>\n\n<p style=\"text-align:justify\">8:00 &ndash; 13:30&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; registr&aacute;cia/prezent&aacute;cia pretek&aacute;rov nasledovn&yacute;ch kateg&oacute;ri&iacute;: <strong> Kadeti, Kedetky &nbsp;&nbsp;&nbsp; </strong>a<strong>&nbsp;Muži &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>19-39 rokov<strong>.</strong></p>\n\n<p style=\"text-align:justify\"><strong>&nbsp;</strong></p>\n\n<p style=\"text-align:justify\"><strong>24. m&aacute;j 2015 </strong> (časy &scaron;tartov):</p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p style=\"text-align:justify\">10:00<span style=\"color:red\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&scaron;tart pretekov pre kateg&oacute;rie: <strong>juniorov, junioriek,</strong> <strong> mužov </strong>40-49 r.,<strong> mužov &nbsp;&nbsp;</strong>50-59 r.,<strong>&nbsp;mužov </strong>60 a<strong> </strong>nad 60 rokov, <strong> žien </strong>19-39 r.,<strong> žien </strong>40-49 r. a<strong>&nbsp;žien </strong>50 a<strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>nad 50 rokov,&nbsp;</p>\n\n<p style=\"text-align:justify\">11:30&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&scaron;tart pretekov pre kateg&oacute;rie: <strong> mini </strong>chlapci a<strong>&nbsp;mini </strong>dievčat&aacute;,</p>\n\n<p style=\"text-align:justify\">14:00&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &scaron;tart pretekov pre kateg&oacute;rie: <strong> Kadetov, kadetiek </strong>a<strong>&nbsp;Mužov </strong>19-39 rokov<strong>.</strong></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p style=\"text-align:justify\"><strong>Dekorovanie v&iacute;ťazov:</strong></p>\n\n<p style=\"text-align:justify\"><strong>&nbsp;</strong></p>\n\n<p style=\"text-align:justify\">12:30&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; odovzd&aacute;vanie cien v&iacute;ťazom v&nbsp;nasledovn&yacute;ch kateg&oacute;ri&aacute;ch: <strong> mini </strong>chlapci a<strong>&nbsp;mini &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>dievčat&aacute;, <strong> juniorov, junioriek,</strong> <strong> mužov </strong>40-49 r.,<strong> mužov </strong>50-59 r.,<strong>&nbsp;mužov &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>60 a<strong> </strong>nad 60 rokov, <strong> žien </strong>19-39 r.,<strong> žien </strong>40-49 r. a<strong>&nbsp;žien </strong>50 a<strong> </strong>nad 50 rokov,</p>\n\n<p style=\"text-align:justify\">16:00&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; odovzd&aacute;vanie cien v&iacute;ťazom v&nbsp;nasledovn&yacute;ch kateg&oacute;ri&aacute;ch: <strong> Kadeti, kadetky &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong>a<strong>&nbsp;Muži </strong>19-39 rokov.</p>\n\n<p>&nbsp;</p>\n\n<p><strong><span style=\"font-size:16.0pt\">&Scaron;tartovn&eacute;:</span></strong></p>\n\n<p><strong>&nbsp;</strong></p>\n\n<p>A/ <strong> Mini</strong> chlapci a&nbsp;<strong>Mini</strong> dievčat&aacute; 2,-&euro;.</p>\n\n<p>&nbsp;</p>\n\n<p>B/ <strong> kadeti, kadetky, juniori, juniorky, muži</strong> a&nbsp;<strong>ženy</strong> 19&ndash;39 r.,<strong> muži </strong>a<strong>&nbsp;ženy</strong> 40&ndash;49 r., <strong> ženy</strong> 50 a nad 50 rokov, <strong> muži</strong> 50-59 r. a&nbsp;<strong>muži</strong> 60 a nad 60 rokov 7,-&euro;.</p>\n\n<p>&nbsp;Prihl&aacute;senie: <a href=\"http://biketeam.sk/prihlaska-karlovesky-kros\">http://biketeam.sk/prihlaska-karlovesky-kros</a></p>\n\n<p style=\"text-align:justify\">V cene &scaron;tartovn&eacute;ho je: &scaron;tartovn&eacute; č&iacute;slo, občerstvenie (jedlo - bageta, pitie) a zaradenie do z&aacute;verečnej tomboly a&nbsp;zisk pam&auml;tn&eacute;ho dresu (v pr&iacute;pade, že sa pretek&aacute;r z&uacute;častnil minim&aacute;lne 5 pretekov Župn&eacute;ho poh&aacute;ra 2015). &Scaron;tartovn&eacute; sa plat&iacute; na mieste registr&aacute;cie.</p>\n\n<p>&nbsp;</p>\n\n<p><strong><span style=\"font-size:16.0pt\">Dĺžky pretekov a&nbsp;vekov&eacute; kateg&oacute;rie (roky naroden&iacute;):</span></strong></p>\n\n<p><strong>&nbsp;</strong></p>\n\n<p><strong>Mini</strong> chlapci (2005 a mlad&scaron;&iacute;) &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4x mal&yacute; okruh,</p>\n\n<p><strong>Mini</strong> dievčat&aacute; (2005 a mlad&scaron;ie)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2x mal&yacute; okruh,</p>\n\n<p><strong><span style=\"color:black\">Kadeti </span></strong><span style=\"color:black\">(1999 a 2000) &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2x veľk&yacute; okruh, <strong> </strong></span></p>\n\n<p><strong><span style=\"color:black\">Kadetky </span></strong><span style=\"color:black\">(1999 a 2000) &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1x veľk&yacute; okruh, <strong> </strong></span></p>\n\n<p><strong>Juniori </strong>(1997 a 1998)<strong> </strong> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3x veľk&yacute; okruh, <strong> </strong></p>\n\n<p><strong>Juniorky </strong>(1997 a 1998) &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2x veľk&yacute; okruh, <strong> </strong></p>\n\n<p><strong>Muži</strong> 19-39 r. (1976 až 1996) &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4x veľk&yacute; okruh,</p>\n\n<p><strong>Muži</strong> 40-49 r. (1966 až 1975) &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3x veľk&yacute; okruh,</p>\n\n<p><strong>Muži</strong> 50-59 r. (1956 až 1965) &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2x veľk&yacute; okruh,</p>\n\n<p><strong>Muži</strong> 60 a nad 60 r. (1955 a star&scaron;&iacute;)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2x veľk&yacute; okruh,</p>\n\n<p><strong>ženy</strong> 19-39 r. (1976 až 1996) &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3x veľk&yacute; okruh,</p>\n\n<p><strong>ženy</strong> 40-49 r. (1966 až 1975)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2x veľk&yacute; okruh,</p>\n\n<p><strong>ženy </strong>50 a<strong> </strong>nad 50 r. (1965 a star&scaron;ie) &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1x veľk&yacute; okruh.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Dĺžky okruhov: </strong></p>\n\n<p><strong>&nbsp;</strong></p>\n\n<p>Mal&yacute; okruh &nbsp;&nbsp;&nbsp; 450 m s&nbsp;25 m prev&yacute;&scaron;en&iacute;m,</p>\n\n<p>veľk&yacute; okruh &nbsp;&nbsp; 5700 m s&nbsp;260 m prev&yacute;&scaron;en&iacute;m (mapy okruhov n&aacute;jdete na: <a href=\"http://www.biketeam.sk\"> www.biketeam.sk</a> ).</p>\n\n<p>&nbsp;</p>\n\n<p>Dĺžka pretekov je orientačn&aacute;, konečn&yacute; počet okruhov urč&iacute; rozhodcovsk&yacute; zbor v deň pretekov.</p>\n\n<p><strong><span style=\"font-size:16pt\">Bodovanie:</span></strong></p>\n\n<p><span style=\"color:rgb(20, 24, 35); font-family:helvetica,arial,lucida grande,sans-serif; font-size:14px\">Bodovanie KAKTUS BIKE Karlovesk&eacute;ho krosu do Župn&eacute;ho poh&aacute;ra 2015 bude nasledovn&eacute;:</span><br />\n<span style=\"color:rgb(20, 24, 35); font-family:helvetica,arial,lucida grande,sans-serif; font-size:14px\">v&iacute;ťaz 4 x veľk&yacute; okruh dostane 1000 bodov (v&iacute;ťaz = najlep&scaron;&iacute; čas na trati)</span><br />\n<span style=\"color:rgb(20, 24, 35); font-family:helvetica,arial,lucida grande,sans-serif; font-size:14px\">v&iacute;ťaz 3 x veľk&yacute; okruh dostane 900 bodov</span><br />\n<span style=\"color:rgb(20, 24, 35); font-family:helvetica,arial,lucida grande,sans-serif; font-size:14px\">v&iacute;ťaz 2 x veľk&yacute; okruh dostane 800 bodov</span><br />\n<span style=\"color:rgb(20, 24, 35); font-family:helvetica,arial,lucida grande,sans-serif; font-size:14px\">v&iacute;ťaz 1 x veľk&yacute; okruh dostane 700 bodov</span><br />\n<span style=\"color:rgb(20, 24, 35); font-family:helvetica,arial,lucida grande,sans-serif; font-size:14px\">ostatn&yacute;m sa bud&uacute; poč&iacute;tať body podľa rovnak&eacute;ho vzorca ako v ostatn&yacute;ch pretekoch seri&aacute;lu od v&iacute;ťazn&eacute;ho času na trati</span></p>\n\n<p><strong><span style=\"font-size:16.0pt\">Ceny:</span></strong></p>\n\n<p>Prv&iacute; traja pretek&aacute;ri/pretek&aacute;rky v&nbsp;každej kateg&oacute;ri&iacute; z&iacute;skaj&uacute; vecn&eacute; ceny.</p>\n\n<p>&nbsp;</p>\n\n<p><strong><span style=\"font-size:16.0pt\">&Scaron;portovo &ndash; technick&eacute; ustanovenia:</span></strong></p>\n\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong></p>\n\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pretek&aacute; sa podľa platn&yacute;ch pravidiel Slovensk&eacute;ho zv&auml;zu cyklistiky (SZC) a&nbsp;medzin&aacute;rodnej cyklistickej &uacute;nie (UCI) pre rok 2015. V&nbsp;dĺžke cel&yacute;ch okruhov je povolen&eacute; pod&aacute;vať občerstvenie a&nbsp;poskytn&uacute;ť technick&uacute; pomoc.</p>\n\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Každ&yacute; pretek&aacute;r &scaron;tartuje na vlastn&uacute; zodpovednosť. Za pretek&aacute;rov mlad&scaron;&iacute;ch ako 18 rokov podp&iacute;&scaron;e počas registr&aacute;cie z&aacute;konn&yacute; z&aacute;stupca informovan&yacute; s&uacute;hlas. Každ&yacute; pretek&aacute;r mus&iacute; byť poisten&yacute;. &Uacute;častn&iacute;ci pretekov s&uacute; povinn&iacute; dodržiavať pokyny usporiadateľa, pokyny pol&iacute;cie a rozhodcov. Organiz&aacute;tor nezodpoved&aacute; za &scaron;kody &uacute;častn&iacute;kom pretekov vzniknut&eacute; ani nimi sp&ocirc;soben&eacute;, neruč&iacute; za &scaron;kody sp&ocirc;soben&eacute; treťou osobou na majetku, zdrav&iacute;, ako aj &scaron;kody sp&ocirc;soben&eacute; pretek&aacute;rom a doprovodom tret&iacute;m osob&aacute;m a subjektom.</p>\n\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cyklistick&yacute; prilba umiestnen&aacute; na hlave a zapnut&aacute; je povinn&aacute; počas cel&yacute;ch pretekov!</p>\n\n<p style=\"text-align:justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Trasa pretekov vedie verejn&yacute;mi mestsk&yacute;mi lesmi, preto buďte aj počas pretekov ohľadupln&iacute; k pr&iacute;rode a jej n&aacute;v&scaron;tevn&iacute;kom!</p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p><strong>Inform&aacute;cie:</strong> <a href=\"mailto:belas@fsport.uniba.sk.sk\"> belas@fsport.uniba.sk.sk</a>, <a href=\"mailto:straka.michal@hotmail.sk\">straka.michal@hotmail.sk</a>, &nbsp;<a href=\"http://www.biketeam.sk\">www.biketeam.sk</a></p>\n\n<p>&nbsp;</p>\n\n<p>V Bratislave 21.04.2015</p>\n\n<p><img alt=\"\" src=\"http://query.sk/dnt-system/data/3/uploads/mapa.jpg\" style=\"width:100%\" /></p>\n","","","","","0","1","","0","58","0"),
(null,"15235","","1044","post","Škoda Svätojurský maratón fotogalérie","skoda-svatojursky-maraton-fotogalerie","0","0","","","3664","2019-03-18 15:26:55","2019-03-18 15:26:55","2015-04-20 11:00:00","0","","<p>Extern&eacute; fotogal&eacute;rie, postupne budeme dopľňať<br />\n<a href=\"https://plus.google.com/photos/105851923932191315796/albums/6139150982968973073\" target=\"_blank\">https://plus.google.com/photos/105851923932191315796/albums/6139150982968973073</a><br />\n<a href=\"http://www.bikeclubnestich.sk/2015/04/skoda-svatojursky-mtb-maraton/\" target=\"_blank\">http://www.bikeclubnestich.sk/2015/04/skoda-svatojursky-mtb-maraton/</a></p>\n","","","","","0","1","","0","58","0"),
(null,"15236","","1044","post","Dres Župný Pohár 2015","dres-zupny-pohar-2015","0","0","","","3665","2019-03-18 15:26:55","2019-03-18 15:26:55","2015-04-16 11:00:00","0","","<p><strong><span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif\">Učastn&iacute;ci aspoň piatich pretekov zo &scaron;iestich dostan&uacute; dres. Prv&eacute; kolo zač&iacute;na už v sobotu 18.4.2015 pretekom </span><span style=\"font-family:helvetica,arial,lucida grande,sans-serif; font-size:14px\">&Scaron;KODA Sv&auml;tojursk&yacute; MTB marat&oacute;n</span><span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif\">.</span></strong></p>\n\n<p><a href=\"http://query.sk/dnt-system/data/3/uploads/dres_zp_2015.jpeg\" target=\"_blank\"><img alt=\"Dres Župný pohár 2015\" src=\"http://query.sk/dnt-system/data/3/uploads/dres_zp_2015.jpeg\" style=\"height:960px; width:1042px\" /></a></p>\n","","","","","0","1","","0","58","0"),
(null,"15237","","1044","post","Župný pohár 2015","zupny-pohar-2015","0","0","","","3666","2019-03-18 15:26:55","2019-03-18 15:26:55","2015-02-04 11:00:00","0","","<p><span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Do celkov&eacute;ho poradia v Župnom poh&aacute;ri sa bud&uacute; poč&iacute;tať&nbsp;</span><strong>&scaron;tyri najlep&scaron;ie v&yacute;sledky zo &scaron;iestich</strong><span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">&nbsp;(bodovo) možn&yacute;ch.</span><br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Bodovanie prebieha samostatne v každ&yacute;ch pretekoch a zarat&uacute;va sa do celkov&yacute;ch v&yacute;sledkov podľa kateg&oacute;ri&iacute;.</span><br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Najr&yacute;chlej&scaron;&iacute; pretek&aacute;r (celkovo) na podujat&iacute; z&iacute;skava nasledovn&eacute; body:</span><br />\n<strong>Marat&oacute;n</strong><span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">: super dlh&aacute; 1600 (Stupava 105km), dlh&aacute; trať 1300, stredn&aacute; trať 1000, kr&aacute;tka trať 700&nbsp;</span><br />\n<strong>Časovka</strong><span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">: 1000</span><br />\n<strong>Cross country</strong><span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">: 1000</span><br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Ostatn&iacute; pretek&aacute;ri a pretek&aacute;rky z&iacute;skavaj&uacute; body v z&aacute;vislosti od dosiahnut&eacute;ho času podľa vzorca:&nbsp;</span></p>\n\n<p>&nbsp;</p>\n\n<p><em><span style=\"background-color:transparent\">Bn = 1000 x (3 &ndash; Tn/T1) / 2;&nbsp;</span></em></p>\n\n<p><span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">kde: Bn ...body n-t&eacute;ho, Tn ...čas n-t&eacute;ho, T1 ...čas v&iacute;ťaza.&nbsp;</span><br />\n<br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Vzorec je nastaven&yacute; tak, aby do celkov&eacute;ho hodnotenia z&iacute;skal body každ&yacute; pretek&aacute;r, ktor&yacute; pr&iacute;de do cieľa najnesk&ocirc;r v trojn&aacute;sobnom čase ako v&iacute;ťaz.&nbsp;</span><br />\n<br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Učastn&iacute;c&iacute; aspoň piatich pretekov zo &scaron;iestich dostan&uacute; dres</span><br />\n<br />\n<strong>Kateg&oacute;rie hodnoten&eacute; v Župnom poh&aacute;ri 2015:</strong><br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Muži 19-39 r.</span><br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Seniori 40-49 r.</span><br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Veter&aacute;ni 50-59 r.</span><br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Veter&aacute;ni 60 a viac r.</span><br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Ženy 19-39 r.</span><br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Ženy 40-49 r.</span><br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Ženy 50 a viac r.</span><br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Juniori 17-18 r.</span><br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Juniorky 17-18 r.</span><br />\n<span style=\"color:rgb(3, 3, 3); font-family:arial,helvetica,sans-serif; font-size:13px\">Kadeti 15-16 r.</span></p>\n","","","","","0","1","","0","58","0"),
(null,"15238","","1044","post","Škoda Stupava Trophy 2014","skoda-stupava-trophy-2014","0","0","","","3668","2019-03-18 15:26:55","2019-03-18 15:26:55","2014-06-01 11:00:00","0","","<p><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:small\">26.7.2014 sa kon&aacute; podujatie pod n&aacute;zvom &Scaron;koda Stupava Trophy 2014, ktor&aacute; je s&uacute;časťou Župn&eacute;ho Poh&aacute;ra</span>, ako jeho 4-t&eacute; kolo.&nbsp;<a href=\"http://www.stupavskymaraton.sk/letny-mtb-maraton-2014/prihlasenie/\" target=\"_blank\" title=\"\">Prihl&aacute;senie</a>&nbsp;<a href=\"http://www.stupavskymaraton.sk/letny-mtb-maraton-2014/prihlaseni-ucastnici/\" target=\"_blank\" title=\"\">&shy;</a></p>\n\n<div>Marat&oacute;n je rozdelen&yacute; na 5 tr&aacute;s&nbsp;<span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:12px\">Trasa A - 105 km&nbsp; / 2950 m prev&yacute;&scaron;enie (jeden okruh),&nbsp;</span><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:12px\">Trasa B&nbsp;- &nbsp; 76 km /&nbsp; 2000 m&nbsp;</span><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:12px\">prev&yacute;&scaron;enie&nbsp;</span><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:12px\">(jeden&nbsp;okruh),&nbsp;</span><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:12px\">Trasa C - &nbsp; 42 km /&nbsp; 1100 m&nbsp;</span><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:12px\">prev&yacute;&scaron;enie&nbsp;</span><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:12px\">&nbsp;(jeden okruh),&nbsp;</span><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:12px\">Trasa D - &nbsp; 25 km / &nbsp; &nbsp;600 m&nbsp;</span><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:12px\">prev&yacute;&scaron;enie&nbsp;</span><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:12px\">&nbsp;(jeden okruh),&nbsp;</span><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:12px\">Trasa E - &nbsp; 17 km / &nbsp; &nbsp; 420 m</span><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:12px\">prev&yacute;&scaron;enie&nbsp;</span><span style=\"color:rgb(34, 34, 34); font-family:arial; font-size:12px\">&nbsp;(jeden okruh).&nbsp;<br />\n&Scaron;tarty v sobotu od 9:00, prezent&aacute;cia&nbsp;<strong>piatok</strong> od <strong>15:00 - 20:00</strong> - pokiaľ &nbsp;m&ocirc;žete, je lep&scaron;ie využiť piatkov&yacute; term&iacute;n a v <strong>sobotu</strong> od<strong> 8:30</strong> a koniec je vždy <strong>pol hodinu</strong> pred &scaron;tartom danej trasy!</span></div>\n\n<div>&nbsp;</div>\n\n<h3><span style=\"font-size:1.17em\">D&aacute;tum konania</span></h3>\n\n<p>D&aacute;tum: sobota 26.7.2014<br />\nMiesto: Stupava, are&aacute;l parku za ka&scaron;tieľom, <a href=\"http://g.co/maps/grtz4\" target=\"_blank\">zobrazenie na Google maps</a>.</p>\n\n<h3>Trasa</h3>\n\n<ul>\n	<li>Trasa A - 105 km / 2950 m prev&yacute;&scaron;enie (jeden okruh)</li>\n	<li>Trasa B - 76 km / 2000 m prev&yacute;&scaron;enie (jeden okruh)</li>\n	<li>Trasa C - 42 km / 1100 m prev&yacute;&scaron;enie (jeden okruh)</li>\n	<li>Trasa D - 25 km / 600 m prev&yacute;&scaron;enie (jeden okruh)</li>\n	<li>Trasa E - 17 km / 420 m prev&yacute;&scaron;enie (jeden okruh) <span style=\"color:#ff0000\"><strong>!!! JEDNOKOLKY !!!</strong></span></li>\n</ul>\n\n<h3>&Scaron;tart</h3>\n\n<ul>\n	<li><u>09:00 Trasa <strong>A 105 km</strong>, 1.vlna</u></li>\n	<li><u>10:00 Trasa <strong>B 76 km</strong>, 1.vlna</u></li>\n	<li>11:00 Trasa <strong>C 42 km</strong>, 1.vlna</li>\n	<li><u>11:15 Trasa <strong>C 42 km</strong>,<strong> </strong>2.vlna</u></li>\n	<li>11:30 Trasa <strong>D 25 km</strong>, 1.vlna</li>\n</ul>\n\n<p><u><u><strong>!!! JEDNOKOLKY !!!</strong></u></u></p>\n\n<ul>\n	<li style=\"text-align:left\"><u>11:35 Trasa <strong>E</strong><strong><strong><strong> 17 km</strong></strong></strong>, 1.vlna<u><strong> </strong></u><span style=\"color:#ff0000\"><strong>!!! JEDNOKOLKY NOVINKA !!!</strong></span></u></li>\n</ul>\n\n<p><strong>Vyhl&aacute;senie v&yacute;sledkov 16.00</strong></p>\n\n<h3>Kateg&oacute;rie</h3>\n\n<h3>Kateg&oacute;ria A 105 km</h3>\n\n<p>A1: ženy nad 18 rokov<br />\nA2: muži od 18 do 29 rokov<br />\nA3: muži od 30 do 39 rokov<br />\nA4: muži nad 40 rokov</p>\n\n<h3>Kateg&oacute;ria B 76 km</h3>\n\n<p>B1: ženy do 39 rokov<br />\nB2: ženy nad 40 rokov<br />\nB3: muži do 29 rokov<br />\nB4: muži od 30 do 39 rokov<br />\nB5: muži od 40 do 49 rokov<br />\nB6: muži nad 50 rokov</p>\n\n<h3>Kateg&oacute;ria C 42 km</h3>\n\n<p>C1: ženy do 18 rokov<br />\nC2: ženy od 19 do 29 rokov<br />\nC3: ženy od 30 do 39 rokov<br />\nC4: ženy od 40 do 49 rokov<br />\nC5: ženy nad 50 rokov<br />\nC6: muži do 18 rokov<br />\nC7: muži od 19 do 29 rokov<br />\nC8: muži od 30 do 39 rokov<br />\nC9: muži od 40 do 49 rokov<br />\nC10: muži od 50 do 59 rokov<br />\nC11: muži nad 60 rokov</p>\n\n<h3>Kateg&oacute;ria D 25 km</h3>\n\n<p>D1: ženy do 18 rokov<br />\nD2: ženy od 19 do 29 rokov<br />\nD3: ženy od 30 do 39 rokov<br />\nD4: ženy od 40 do 49 rokov<br />\nD5: ženy nad 50 rokov<br />\nD6: muži do 18 rokov<br />\nD7: muži od 19 do 29 rokov<br />\nD8: muži od 30 do 39 rokov<br />\nD9: muži od 40 do 49 rokov<br />\nD10: muži od 50 do 59 rokov<br />\nD11: muži nad 60 rokov</p>\n\n<h3>Kateg&oacute;ria pre JEDNOKOLKY E 17 km <span style=\"color:#ff0000\">!!! NOVINKA !!!</span></h3>\n\n<p>E1: ženy/muži v&scaron;etky vekov&eacute; kateg&oacute;rie</p>\n\n<h3>Prezent&aacute;cia</h3>\n\n<ul>\n	<li>piatok deň pred marat&oacute;nom od 15:00 do 20:00, v&scaron;etky trasy</li>\n	<li>sobota od 08:00 do 08:30, <strong>A trasa</strong></li>\n	<li>sobota od 08:00 do 09:30, <strong>B trasa</strong></li>\n	<li>sobota od 08:00 do 10:30, <strong>C trasa</strong></li>\n	<li>sobota od 08:00 do 11:30, <strong>D trasa</strong></li>\n	<li style=\"text-align:left\">sobota od 08:00 do 11:30, <strong>E trasa<span style=\"color:#ff0000\"><strong> !!! JEDNOKOLKY NOVINKA !!!</strong></span></strong></li>\n</ul>\n\n<p>Za prihl&aacute;sen&eacute;ho ste považovan&iacute; len po zaplaten&iacute; &scaron;tartovn&eacute;ho.</p>\n\n<h3>Občerstvenie</h3>\n\n<ul>\n	<li><strong>A trasa </strong><strong>6</strong>x</li>\n	<li><strong>B trasa </strong><strong>4</strong>x</li>\n	<li><strong>C trasa</strong> 2x</li>\n	<li><strong>D trasa </strong>1x</li>\n	<li><strong>E trasa </strong>1x</li>\n	<li>v cieli</li>\n	<li>GATORADE - ofici&aacute;lny &scaron;portov&yacute; n&aacute;poj Stupavsk&eacute;ho MTB marat&oacute;nu</li>\n	<li>na&scaron;e občerstvovacie stanice zabezpeč&iacute; pečivom firma &quot;PEK&Aacute;REŇ U FLORI&Aacute;NKA&quot;</li>\n	<li>cere&aacute;lne tyčinky na občerstvovacie stanice n&aacute;m dod&aacute; firma POWERBAR</li>\n	<li>občerstvovacie stanice bud&uacute; ďalej zabezpečen&eacute; ban&aacute;nmi, mel&oacute;nmi, horalkami, kol&aacute;čmi, soľ, čerstvou vodou, nealko pivo, atď.</li>\n</ul>\n\n<p>Odpadky je možn&eacute; odhadzovať len na občerstvovac&iacute;ch staniciach GATORADE, ktor&eacute; s&uacute; v propoz&iacute;ci&aacute;ch vyznačen&eacute; na mape.</p>\n\n<h3>Syst&eacute;m občerstvovac&iacute;ch stan&iacute;c - STUPAVA TROPHY</h3>\n\n<p>Zabezpečujeme &scaron;esť GATORADE občerstvovac&iacute;ch stan&iacute;c pre MTB bajkerov (Kamz&iacute;k, Biely Kr&iacute;ž, &Scaron;enk&aacute;rka, Pernek, Lozorno, Ko&scaron;arisk&aacute;) &scaron;iestimi veľkokapacitn&yacute;mi n&aacute;dobami na pitn&uacute; vodu, každ&aacute; o objeme 1 m3. V cieli bude pitn&aacute; voda zabezpečen&aacute; dvomi cisternami od Bratislavskej Vod&aacute;renskej Spoločnosťi o objeme 1 m3. Syst&eacute;m pripravujeme v spolupr&aacute;ci s partnermi: <span style=\"font-size:11.0pt\"><a href=\"http://krajn.sk/\" target=\"_blank\"><strong><span style=\"font-family:verdana,sans-serif; font-size:7.5pt\"><strong>Stavebniny KRAJN</strong></span></strong></a></span><span style=\"font-family:verdana,sans-serif; font-size:7.5pt\"> </span><span style=\"font-family:verdana,sans-serif; font-size:7.5pt\">Stupava, </span><strong><a href=\"http://www.berto.sk/web/index.php\" target=\"_blank\"><strong>BERTO m&auml;so v&yacute;roba</strong></a></strong> Vysok&aacute; pri Morave, <strong><a href=\"http://www.bvsas.sk/sk/\" target=\"_blank\"><strong>Bratislavska Vod&aacute;renska Spoločnosť</strong></a></strong> a <span style=\"font-size:11.0pt\"><a href=\"http://www.stupava.sk/web/src/index.php?lg=sk&amp;pgid=223&amp;pgidsec=&amp;artid_aktual=250\" target=\"_blank\"><strong><span style=\"font-family:verdana,sans-serif; font-size:7.5pt\"><strong>dobrovoľn&iacute; HASIČI</strong></span></strong></a></span><span style=\"font-family:verdana,sans-serif; font-size:7.5pt\"> </span><span style=\"font-family:verdana,sans-serif; font-size:7.5pt\">mesta Stupava.</span><br />\n<br />\nOdpadky je možn&eacute; odhadzovať len na občerstvovac&iacute;ch staniciach GATORADE, ktor&eacute; s&uacute; v propoz&iacute;ci&aacute;ch vyznačen&eacute; na mape.<br />\n<br />\n<img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/Obcerstvovacie_stanice___GATO__KRAJN__BERTO__BVS___WEB.jpg\" style=\"height:285px; width:600px\" /></p>\n\n<p>Pretek&aacute;ri mlad&scaron;&iacute; ako 18 rokov m&ocirc;žu &scaron;tartovať len s p&iacute;somn&yacute;m s&uacute;hlasom z&aacute;konn&eacute;ho z&aacute;stupcu, ktor&yacute; podp&iacute;&scaron;e prihl&aacute;&scaron;ku pri prezent&aacute;cii.</p>\n\n<h3>Prihl&aacute;senie</h3>\n\n<p>Na preteky sa m&ocirc;žete prihl&aacute;siť cez <a href=\"http://www.stupavskymaraton.sk/texty/letny-mtb-maraton-2014/prihlasenie/\">online registr&aacute;ciu</a> do 24.7.2014, 23:59 hod. Po online registr&aacute;cii je nutn&eacute; si prihl&aacute;&scaron;ku vytlačiť a priniesť so sebou na prezent&aacute;ciu.<br />\n<br />\n<strong>Č&iacute;slo &uacute;čtu pre EUR:</strong> 260 060 6996/8330<br />\n<strong>Č&iacute;slo &uacute;čtu pre CZK: 260 060 6996/2010</strong><br />\n<strong>IBAN:</strong> SK03 8330 0000 0026 0060 6996<br />\n<span style=\"color:#222222; font-family:arial; font-size:12px\"><strong>SWIFT / BIC: </strong><strong>FIOZSKBAXXX</strong></span><br />\n<br />\n<strong><u>Adresa banky pre medzin&aacute;rodn&eacute; platby a platby v cudz&iacute;ch men&aacute;ch:</u></strong><br />\n<strong>Fio banka, a.s.,</strong><br />\nPobočka zahraničnej banky,<br />\nN&aacute;mestie SNP 21,<br />\n811 01 Bratislava,<br />\n<u><strong>SLOVAKIA</strong></u></p>\n\n<p><br />\nAko variabiln&yacute; symbol použite registračn&eacute; č&iacute;slo, ktor&eacute; v&aacute;m bolo pridelen&eacute; pri registr&aacute;cii (je uveden&eacute; na prihl&aacute;&scaron;ke, ako aj v <a href=\"http://www.stupavskymaraton.sk/texty/letny-mtb-maraton-2014/prihlaseni-ucastnici/\" target=\"_blank\">zozname prihl&aacute;sen&yacute;ch &uacute;častn&iacute;kov</a>).</p>\n\n<h3><span style=\"font-size:1.17em\">&Scaron;tartovn&eacute;</span></h3>\n\n<ul>\n	<li>uhraden&eacute; od 1.2.2014 do polnoci 30.4.2014 - 15 &euro; / (450 Kč)</li>\n	<li>uhraden&eacute; od 1.5.2014 do polnoci 22.7.2014 - 20 &euro; / (600 Kč)</li>\n	<li>uhraden&eacute; od 23.7. a osobne pri prezent&aacute;cii v piatok a v deň &scaron;tartu &ndash; 25 &euro; / (750 Kč)</li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h3 style=\"text-align:center\"><span style=\"color:#ff0000\"><a href=\"http://www.skoda-auto.sk/prislusenstvo/cyklistika\" target=\"_blank\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/Flasky___Propozicie.png\" style=\"height:238px; width:600px\" /></a></span></h3>\n\n<p style=\"text-align:center\"><a href=\"http://www.skoda-auto.sk/prislusenstvo/cyklistika\" target=\"_blank\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/WEB___SKODA_Darceky___MUZI.jpg\" style=\"height:285px; width:600px\" /></a></p>\n\n<p style=\"text-align:center\"><a href=\"http://www.skoda-auto.sk/prislusenstvo/cyklistika\" target=\"_blank\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/WEB___SKODA_Darceky___ZENY.jpg\" style=\"height:285px; width:600px\" /></a></p>\n\n<p><u>V cene &scaron;tartovn&eacute;ho je:</u></p>\n\n<p><u><strong>&Scaron;tartov&yacute; baliček:</strong></u><br />\nKažd&yacute; &uacute;častn&iacute;k marat&oacute;nu si v n&aacute;jde v bal&iacute;čku &scaron;tartov&eacute; č&iacute;slo, merac&iacute; čip, PowerGel mango-gran&aacute;tov&eacute; jablko od PowerBar; pam&auml;tn&eacute; promo balenie Cyklo Star; Filmov&yacute; dokument zo STUPAVA TROPHY (bude vyhotoven&eacute; cca tri mesiace po uskutočnen&iacute; podujatia); pam&auml;tn&eacute; tričko STUPAVA TROPHY (osobne pri prezent&aacute;cii v deň &scaron;tartu negarantujeme).<br />\n<strong><u>Občerstvenie:</u></strong><br />\nna trati 6x; občerstvenie v cieli 1x (0.5L &scaron;portov&yacute; n&aacute;poj GATORADE alebo 0,5l nealko alebo pivo (alko/nealko)), v cieli 1x rizoto alebo gul&aacute;&scaron;, pitn&aacute; voda.<br />\n<u><strong>Um&yacute;vanie a str&aacute;žen&eacute; parkovanie bicyklov, sprchy, &uacute;schovňa osobn&yacute;ch vec&iacute;:</strong></u><br />\nPre MTB pretek&aacute;rov bude k dispoz&iacute;cii 16 &scaron;pičkov&yacute;ch um&yacute;vac&iacute;ch boxov CYKLO STAR a ZDARMA bude pripraven&eacute; str&aacute;žen&eacute; parkovisko bicyklov. Pre pretek&aacute;rov MTB a XC BEH-u bud&uacute; pripraven&eacute; oddelen&eacute; sprchy a &uacute;schovňa batožiny.</p>\n\n<p>&nbsp;</p>\n\n<p style=\"text-align:center\"><a href=\"http://www.skoda-auto.sk/\" target=\"_blank\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/Tricko___SKODA_STUPAVA_TROPHY_2014___WEB.jpg\" style=\"height:535px; width:360px\" /></a></p>\n\n<p><a href=\"http://davorin.sk/sportova-vyziva/\" target=\"_blank\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/NEW_PowerGel_Fruit_Mango_Passionfruit_01.jpg\" style=\"height:280px; text-align:center; width:630px\" /></a></p>\n\n<p>&nbsp;</p>\n\n<p>Na&scaron;i &scaron;tedr&iacute; sponzori pripravili pre &uacute;častn&iacute;kov Stupavsk&eacute;ho MTB marat&oacute;nu vecn&eacute; ceny v celkovej hodnote <strong>30.000,- EUR</strong>. Každ&yacute;, kto absolvuje n&aacute;&scaron; MTB marat&oacute;n, m&aacute; &scaron;ancu z&iacute;skať niečo hodnotn&eacute;, a to v podobe bal&iacute;čka pre v&iacute;ťazov, alebo v na&scaron;ej tombole.</p>\n\n<h3>Ceny:</h3>\n\n<p><a href=\"http://www.uvexsports.sk/\" target=\"_blank\"><strong><span style=\"font-family:verdana,sans-serif; font-size:7.5pt\">POINTS SLOVENSKO</span></strong></a><span style=\"font-family:verdana,sans-serif; font-size:7.5pt\"> </span><span style=\"font-family:verdana,sans-serif; font-size:7.5pt\">venuje niektor&yacute;m z 25 v&iacute;ťazov v každej kateg&oacute;rii MTB, BEH a JUNIOR TROPHY kvalitn&eacute; značkov&eacute; prilby <strong>UVEX</strong> modelovej rady <strong>FP 1 FDJ</strong> v hodnote </span><strong><span style=\"color:fuchsia; font-family:verdana,sans-serif; font-size:7.5pt\">160,- Eur</span></strong><span style=\"font-family:verdana,sans-serif; font-size:7.5pt\"> za kus. </span><strong>UVEX - PROTECTING PEOPLE.</strong></p>\n\n<p><a href=\"http://www.points.sk/\" style=\"font-size: 10px;\" target=\"_blank\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/uvex_FP_1_FDJ___Stupava_trophy_2014___WEB.jpg\" style=\"height:285px; width:600px\" /></a></p>\n\n<p>&nbsp;</p>\n\n<p>Každ&yacute; v&iacute;ťaz &Scaron;KODA STUPAVA TROPHY z&iacute;skava funkčn&eacute; &scaron;portov&eacute; ponožky <span style=\"color:#ff6600\"><span style=\"color:#ff6600\"><a href=\"http://www.eleven-sportswear.cz/10-ponozky\" target=\"_blank\"><span style=\"color:#ff6600\"><strong>ELEVEN</strong></span></a></span></span>.</p>\n\n<p style=\"text-align:center\"><a href=\"http://www.eleven-sportswear.cz/10-ponozky\" target=\"_blank\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/eleven_baner___PROPOZICIE.jpg\" style=\"height:246px; width:600px\" /></a></p>\n\n<p>&nbsp;</p>\n\n<p><span style=\"color:#ff00ff\"><strong><a href=\"http://davorin.sk/\" target=\"_blank\"><span style=\"color:#ff00ff\">DAVORIN</span></a></strong></span> venoval 102 v&iacute;ťazom z kateg&oacute;rie MTB a RUN kvalitn&uacute; čelenku značky <strong><span style=\"color:#ff00ff\"><a href=\"http://sportful.sk/\" target=\"_blank\"><span style=\"color:#ff00ff\">SPORTFUL</span></a></span></strong>.</p>\n\n<p><a href=\"http://sportful.sk/\" target=\"_blank\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/WEB___Davorin___Sportful_celenky.jpg\" style=\"height:285px; width:600px\" /></a></p>\n\n<p>Vecn&eacute; ceny z&iacute;skaj&uacute; prv&iacute; traja pretek&aacute;ri v každej kateg&oacute;rii. Ceny pre v&iacute;ťazov pripravili: <a href=\"http://www.skoda-auto.sk/\" target=\"_blank\"><strong><span style=\"color:#339966\">&Scaron;KODA</span></strong></a> poskytne hodnotn&eacute; ceny v celkovej hodnote 14.000,- EUR; UVEX poskytne značkov&eacute; okuliare v celkovej hodnote 3.719,- EUR; CYKLOHOUSE, cykloobchod z Bratislavy, poskytne hodnotn&eacute; cyklo doplnky v hodnote 2.000,- EUR; ELEVEN poskytne hodnotn&eacute; &scaron;portov&eacute; oblečenie v celkovej hodnote 1.000,- EUR; KOLIESKO, cykloobchod zo Stupavy, poskytne hodnotn&eacute; cyklo doplnky v hodnote 600,- EUR; Bicykle Peter Pr&iacute;vara poskytne ceny v celkovej hodnote 505,- EUR; DAVORIN-SPORTFUL poskytne &scaron;peci&aacute;lne cyklo doplnky v celkovej hodnote 600,- EUR; FOTOLAB poskytne zľavov&eacute; kup&oacute;ny na foto na pl&aacute;tno, rozmer 80x60, foto na pl&aacute;tno, rozmer 60x40, CEWE Fotoknihu, tvrd&aacute; v&auml;zba, 26 str&aacute;n; Hotel Eminent Stupava poskytne poukazy na bowling + konzumn&eacute; v celkovej hodnote 400,- EUR; Pepsi Cola-Gatorade; Pivovary Topvar poskytnu vecne ceny.</p>\n\n<p>&nbsp;</p>\n\n<p><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/fotolab-6-s.png\" style=\"display:block; height:73px; margin-left:auto; margin-right:auto; width:237px\" /></p>\n\n<div style=\"margin: 20px;\"><a class=\"quiteview\" href=\"subory/fotolab-1-f.jpg\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/fotolab-1-s.png\" style=\"height:60px; width:107px\" /></a> <a class=\"quiteview\" href=\"subory/fotolab-4-f.jpg\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/fotolab-4-s.jpg\" style=\"height:234px; width:260px\" /></a> <a class=\"quiteview\" href=\"fotolab-3-f.png\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/fotolab-3-s.png\" style=\"height:69px; width:107px\" /></a></div>\n\n<h3>Tombola:<span style=\"color:#ff0000\"> </span></h3>\n\n<p>Každ&yacute; &uacute;častn&iacute;k pretekov bude zaraden&yacute; do tomboly. Žrebovanie sa uskutočn&iacute; ihneď po vyhodnoten&iacute; pretekov. Ceny do tomboly poskytli:</p>\n\n<p><strong><span style=\"color:#000000\">1. cenu v MTB tombole venuje</span>, <strong><a href=\"http://www.skoda-auto.sk/\" target=\"_blank\"><span style=\"color:#339966\">&Scaron;KODA</span></a></strong><span style=\"color:#000000\">.</span></strong></p>\n\n<p style=\"text-align:center\"><a href=\"http://www.skoda-auto.sk/prislusenstvo/cyklistika\" target=\"_blank\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/13_Propozicie_MTB_3.jpg\" style=\"height:227px; width:600px\" /></a></p>\n\n<h3><span style=\"font-size:11.0pt\"><span style=\"font-family:arial,sans-serif; font-size:10pt\"><span style=\"color:#000000\"><u>2. cenu v MTB tombole venuje CYKLOHOUSE</u></span></span></span></h3>\n\n<p>Bicyklov&yacute; obchod <a href=\"http://www.cyklohouse.sk/\" target=\"_blank\"><span style=\"color:#33cccc\"><strong><span style=\"color:#00ccff\">CYKLOHOUSE</span></strong></span></a> s&iacute;dliaci na ulici 29. augusta 9 v Bratislave venuje horsk&yacute; bicykel MARIN, model Iron Springs, v hodnote <strong><span style=\"color:#ff00ff\">735,- EUR</span></strong>.</p>\n\n<h3>&nbsp;</h3>\n\n<p><a href=\"http://www.cyklohouse.sk/\" target=\"_blank\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/WEB___2cena_v_MTB_tombole___MARIN_Iron_Springs.jpg\" style=\"height:247px; width:600px\" /></a></p>\n\n<h3><br />\n<span style=\"font-size:11.0pt\"><span style=\"font-family:arial,sans-serif; font-size:10pt\"><span style=\"color:#000000\"><strong><u>3. cenu v MTB tombole venuje FOTOLAB</u></strong></span></span></span></h3>\n\n<p><span style=\"font-size:11.0pt\"><a href=\"http://www.fotolab.sk/\" target=\"_blank\"><strong><span style=\"font-family:arial,sans-serif; font-size:10pt\">FOTOLAB</span></strong></a></span><span style=\"font-family:arial,sans-serif; font-size:10pt\"> </span><span style=\"font-family:verdana,sans-serif; font-size:10pt\">venuje jedn&eacute;mu bajkerovi GoPro HERO3+ Silver Edition, aj s &uacute;chytom na bicykel v hodnote <span style=\"color:fuchsia\"><strong>384,-&euro;</strong></span></span><span style=\"font-family:verdana,sans-serif; font-size:13.333333969116211px\">.</span></p>\n\n<p><a href=\"http://www.fotolab.sk/\" target=\"_blank\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/Propozicie_banner_gopro_630x260.jpg\" style=\"height:246px; width:600px\" /></a></p>\n\n<p>&nbsp;</p>\n\n<p>Na tombole sa bude ďalej podieľať CYKLOHOUSE, Hotel Eminent Stupava poskytne &scaron;peci&aacute;lne poukazy do re&scaron;taur&aacute;cie v hodnote 300,- EUR; ďalej KOLIESKO cyklo obchod zo Stupavy; Bicykle Peter Privara Bratislava; ZANZO BIKE Bratislava.</p>\n\n<h3><br />\nCena PRIM&Aacute;TORA hlavn&eacute;ho mesta BRATISLAVA</h3>\n\n<p><span style=\"font-size:10px\">Absol&uacute;tny v&iacute;ťaz kombin&aacute;cie MTB + BEH z&iacute;ska pobyt v hodnote </span><strong><span style=\"color:#000000\">250,- EUR</span></strong><span style=\"font-size:10px\">. Poukaz venoval </span><strong><a href=\"http://www.carlton.sk/hotel/8\" target=\"_blank\">Radison Blue Carlton Hotel</a><a href=\"http://www.austria-trend.at/hotel-bratislava/sk/location.asp\" target=\"_blank\">,</a></strong><span style=\"font-size:10px\"> Bratislava.</span></p>\n\n<p><a href=\"http://www.carlton.sk/hotel/8\" target=\"_blank\"><img alt=\"\" src=\"http://www.stupavskymaraton.sk/texty/WEB___Cena_primatora.png\" style=\"height:283px; width:600px\" /></a></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<h3>Dodatočn&eacute; inform&aacute;cie</h3>\n\n<ul>\n	<li>Vklady dopredu prihl&aacute;sen&yacute;ch pretek&aacute;rov, ktor&iacute; sa nez&uacute;častnia pretekov nebud&uacute; vr&aacute;ten&eacute;.</li>\n	<li>Doklad o zaplaten&iacute; si zoberte na prezent&aacute;ciu pre pr&iacute;pad reklam&aacute;cie.</li>\n	<li>V pr&iacute;pade neuskutočnenia z&aacute;vodu z d&ocirc;vodu živelnej pohromy alebo epid&eacute;mie sa &scaron;tartovn&eacute;<br />\n	nevracia.</li>\n	<li>&Uacute;častn&iacute;k podujatia berie na vedomie, že počas preteku bude na trati p&ocirc;sobiť fotoservis partnera podujatia. Z&aacute;roveň v tejto s&uacute;vislosti udeľuje s&uacute;hlas so zaslan&iacute;m informačn&eacute;ho e-mailu od partnera podujatia, odkazuj&uacute;cim na zhotoven&eacute; fotografie. S&uacute;hlas pre fotoservis plat&iacute; po dobu maxim&aacute;lne 15 dn&iacute; po ukončen&iacute; podujatia.</li>\n</ul>\n\n<h3>Časomieru zabezpečuje</h3>\n\n<ul>\n	<li>firma: VOS-TPK</li>\n	<li>technika merania času: pas&iacute;vny čip</li>\n	<li>počet kontroln&yacute;ch stanov&iacute;sk-checkpointov: 2x</li>\n	<li>v pr&iacute;pade straty a neodovzdania čipu, &scaron;tartuj&uacute;ci uhrad&iacute; poplatok 10 &euro;</li>\n	<li>časomiera bude merať čas cyklistom do 18.00 hod.</li>\n</ul>\n\n<h3>Značenie a zabezpečenie trate zaisťuje hlavn&yacute; partner<br />\n<span style=\"color:#000\">IRS - International Rescue System Slovakia s.r.o.</span></h3>\n\n<ul>\n	<li>nov&yacute; syst&eacute;m značenia trate ktor&yacute;, zvy&scaron;uje zabezpečenie cyklistov na Stupavskom MTB marat&oacute;ne 2010</li>\n	<li>reflexn&eacute; tabule značenia bud&uacute; od &scaron;tartu smerom k cieľu č&iacute;slovan&eacute; vzostupne (1,2,3, 4,...atď.)</li>\n	<li>na značen&iacute; sa bude priebežne zobrazovať počet kilometrov zost&aacute;vaj&uacute;cich do cieľa, a kontaktn&eacute; telef&oacute;nne č&iacute;slo pre pr&iacute;pad n&uacute;dze</li>\n	<li>IRS vymedz&iacute; a označ&iacute; na trati &uacute;seky medzi jednotliv&yacute;mi tabuľami, kde nie je pokrytie sign&aacute;lom pre mobiln&eacute; GSM telef&oacute;ny (napr. medzi tabuľami 45 - 55 nie je pokrytie sign&aacute;lom GSM; tieto inform&aacute;cie poskytne IRS cyklistom v r&aacute;mci bezpečnostnej prezent&aacute;cie trate tesne pred &scaron;tartom marat&oacute;nu)</li>\n	<li>IRS vybav&iacute; organizačn&yacute; t&iacute;m &scaron;peci&aacute;lnymi mobin&yacute;mi telef&oacute;nmi satelitnej siete IR&Iacute;DIUM</li>\n	<li>IRS a organiz&aacute;tori bud&uacute; použ&iacute;vať spoločn&eacute; vysielačky</li>\n	<li>IRS vybav&iacute; určit&yacute; počet cyklistov akt&iacute;vnymi čipmi GPS registrovan&yacute;mi na &scaron;tartuj&uacute;cich; na n&aacute;mest&iacute; v mieste &scaron;tartu a cieľa bude umiestnen&eacute; prenosov&eacute; vozidlo IRS, ktor&eacute; bude on-line sledovať trať a polohu cyklistov označen&yacute;ch čipmi GPS</li>\n	<li>IRS umiestni na určit&eacute; miesta trate hliadky z&aacute;chran&aacute;rov, ktor&iacute; bud&uacute; s&uacute;časne s monitorovan&iacute;m bezpečnosti na t&yacute;chto &uacute;sekoch uskutočňovať aj prevent&iacute;vne evidovanie prech&aacute;dzaj&uacute;cich cyklistov. Cyklistov bud&uacute; porovn&aacute;vať so zoznamom &scaron;tartuj&uacute;cich uzavret&yacute;m tesne pred &scaron;tartom marat&oacute;nu. Organizačn&yacute; t&iacute;m bude mať e&scaron;te viac inform&aacute;ci&iacute; o pohybe cyklistov na viacer&yacute;ch miestach trate a z&aacute;roveň je zaisten&aacute; e&scaron;te vy&scaron;&scaron;ia bezpečnosť &uacute;častn&iacute;kov marat&oacute;nu</li>\n	<li>IRS zabezpečuje na&scaron;e podujatie pre pr&iacute;pad n&uacute;dze vrtuľn&iacute;kom, sanitn&yacute;mi vozidlami, &scaron;tvorkolkami, motorkami, dod&aacute;vkov&yacute;mi automobilmi, odťahovou službou a inou &scaron;peci&aacute;lnou technikou</li>\n	<li>vrtuľn&iacute;k sa bude dať využiť aj na platen&eacute; komerčn&eacute; vyhliadkov&eacute; lety nad na&scaron;&iacute;m marat&oacute;nom v Stupave, v pr&iacute;pade z&aacute;ujmu bude k dispoz&iacute;cii aj &scaron;irokej verejnosti, novin&aacute;rom, fotografom, kameramanom a telev&iacute;znym &scaron;t&aacute;bom. <span style=\"font-family:arial\">Viac inform&aacute;ci&iacute; n&aacute;jdete na na&scaron;ej webovej str&aacute;nke v sekcii <a href=\"http://www.stupavskymaraton.sk/texty/program-maratonu/\">Program</a></span></li>\n	<li><span style=\"color:#08486b\">IRS a EHC Service si vyhradzuj&uacute; pr&aacute;vo odvolať vrtuľn&iacute;k z n&aacute;&scaron;ho podujatia v pr&iacute;pade nevhodn&yacute;ch poveternostn&yacute;ch podmienok, alebo za in&yacute;ch nepredv&iacute;dan&yacute;ch okolnost&iacute;</span></li>\n	<li>IRS zabezpeč&iacute; na n&aacute;mest&iacute; cyklistom pred &scaron;tartom marat&oacute;nu bezpečnostn&uacute; prezent&aacute;ciu k v&scaron;etk&yacute;m vy&scaron;&scaron;ie uveden&yacute;m inform&aacute;ci&aacute;m</li>\n	<li>IRS poskytne nafukovacie sprchov&eacute; kab&iacute;nky pre &uacute;častn&iacute;kov, ktor&iacute; sa bud&uacute; chcieť osprchovať</li>\n</ul>\n\n<p>Pre cyklistov a ich bicykle bude k dispoz&iacute;cii um&yacute;vacia stanica.</p>\n\n<h3>Servis na trati, v priestore &scaron;tartu a cieľa zabezpečuje &scaron;portov&yacute; partner KOLIESKO.</h3>\n\n<ul>\n	<li>rozlož&iacute; na n&aacute;mest&iacute; v Stupave servisn&yacute; stan, v ktorom bude poskytovať cyklistom kompletn&yacute; servis a poradenstvo</li>\n	<li>vybav&iacute; &scaron;tvorkolku-pojazdn&yacute; servis na trati n&aacute;rad&iacute;m a materi&aacute;lom pre pr&iacute;pad mal&eacute;ho servisu alebo poruchy na trati</li>\n	<li>vybav&iacute; občerstvovačky n&aacute;rad&iacute;m a materi&aacute;lom pre pr&iacute;pad mal&eacute;ho servisu alebo por&uacute;ch</li>\n	<li>umožn&iacute; servis aj mimo občerstvovačiek a to na určit&yacute;ch miestach pre pr&iacute;pad mal&eacute;ho servisu alebo poruchy na trati</li>\n</ul>\n\n<h3>Podmienky &uacute;časti</h3>\n\n<ul>\n	<li>podujatie sa uskutočn&iacute; za každ&eacute;ho počasia, v pr&iacute;pade extr&eacute;mne nepriazniv&eacute;ho alebo chladn&eacute;ho počasia si usporiadateľ z bezpečnostn&yacute;ch d&ocirc;vodov vyhradzuje pr&aacute;vo na zmenu (skr&aacute;tenie) trate</li>\n	<li>cyklomarat&oacute;n sa ide za plnej cestnej prem&aacute;vky na vlastn&eacute; nebezpečenstvo</li>\n	<li>odpor&uacute;čame lek&aacute;rsku prehliadku</li>\n	<li>osoby do 18 rokov s&uacute; povinn&eacute; k prihl&aacute;&scaron;ke doložiť p&iacute;somn&yacute; s&uacute;hlas rodičov (!), osoby do 15 rokov sm&uacute; absolvovať marat&oacute;n len v sprievode z&aacute;konn&eacute;ho z&aacute;stupcu</li>\n	<li>certifikovan&aacute; prilba podľa najnov&scaron;&iacute;ch noriem je povinn&aacute; pre v&scaron;etk&yacute;ch pretek&aacute;rov počas cel&yacute;ch pretekov ( kožen&aacute;, cestn&aacute; retro pokr&yacute;vka hlavy nie je prilba určen&aacute; pre n&aacute;&scaron; MTB marat&oacute;n!!!, v pr&iacute;pade že ju bajker použije a nedodrž&iacute; na&scaron;e nariadenie, bude rozhodcom nekompromisne diskvalifikovan&yacute; )</li>\n</ul>\n\n<p>Zloženie prilby počas pretekov bude potrestan&eacute; diskvalifik&aacute;ciou pretek&aacute;ra a aj n&aacute;sledn&yacute;m vyl&uacute;čen&iacute;m zo žrebovania v tombole! Usporiadateľ, ako aj v&scaron;etky osoby a organiz&aacute;cie, ktor&eacute; s&uacute; spojen&eacute; s uskutočnen&iacute;m podujatia odmietaj&uacute; v&yacute;slovne &uacute;častn&iacute;kom každ&eacute; ručenie za &scaron;kody os&ocirc;b, vec&iacute; a majetku, ktor&eacute; sa vyskytn&uacute; pred, v priebehu alebo po podujat&iacute;. &Uacute;častn&iacute;ci jazdia v každom ohľade na vlastn&eacute; nebezpečenstvo a nes&uacute; civiln&uacute; (občiansku) aj trestnopr&aacute;vnu zodpovednosť za v&scaron;etky nimi alebo ich vozidlami sp&ocirc;soben&eacute; &scaron;kody. &Uacute;častn&iacute;ci sa podpisom zriekaj&uacute; uzavretia tohto ručenia pri každom v s&uacute;vislosti so s&uacute;ťažou utrpenom &uacute;raze alebo nehode na pr&aacute;vo postupovania alebo postih voči usporiadateľom a ich zmocnencom. Beriem na vedomie, že v pr&iacute;pade &uacute;razu nebudem kl&aacute;sť na usporiadateľov žiadne n&aacute;roky. Ďalej beriem na vedomie, že sa dodržia nariadenia usporiadateľov. Som uzrozumen&yacute; (s&uacute;hlas&iacute;m) s podmienkami &uacute;časti a prihlasujem sa na vy&scaron;&scaron;ie uveden&eacute; podujatie. Pre osoby mlad&scaron;ie ako 18 rokov je nevyhnutn&yacute; podpis z&aacute;konn&eacute;ho z&aacute;stupcu. V pr&iacute;pade odst&uacute;penia z pretekov a nenahl&aacute;senia svojho odst&uacute;penia organiz&aacute;torovi, zn&aacute;&scaron;a v&scaron;etky n&aacute;sledky spojen&eacute; s jeho hľadan&iacute;m s&aacute;m pretek&aacute;r.</p>\n\n<h3>Ubytovanie:</h3>\n\n<p><a href=\"http://www.stupavskymaraton.sk/texty/ubytovanie/\">Tu</a><br />\n<br />\n<strong><u>V pr&iacute;pade nejasnost&iacute; n&aacute;s kontaktujte:</u></strong><br />\nJuraj J&aacute;no&scaron;&iacute;k, <a href=\"mailto:juro@stupavskymaraton.sk\">juro@stupavskymaraton.sk</a><br />\nPavol Grujbar, <a href=\"mailto:palo@stupavskymaraton.sk\">palo@stupavskymaraton.sk</a><br />\n<br />\nPreteky sa konaj&uacute; za každ&eacute;ho počasia.<br />\nOrganiz&aacute;tor pretekov si vyhradzuje pr&aacute;vo zmeny programu.</p>\n","","","","","0","1","","0","58","0"),
(null,"15239","","1044","post","Prvé kolo Župného pohára vo Svätom Juri je za nami","prve-kolo-zupneho-pohara-vo-svatom-juri-je-za-nami","0","0","","","3669","2019-03-18 15:26:55","2019-03-18 15:26:55","2014-04-20 11:00:00","0","","<p>Prve&eacute; kolo Župn&eacute;ho poh&aacute;ra je &uacute;spe&scaron;ne za nami. Za pr&iacute;jemn&eacute;ho jarn&eacute;ho počasia n&aacute;m Župn&yacute; Poh&aacute;r, tak ako tradične otvoril pretek Specialized Sv&auml;tojursk&yacute; MTB marat&oacute;n.&nbsp;&nbsp;Pre pretek&aacute;rov boli pripraven&eacute; tri varianty trat&iacute; detsk&eacute; 20km s prev&yacute;&scaron;en&iacute;m 550m, 44km s prev&yacute;&scaron;en&iacute;m&nbsp;&nbsp;1000m a&nbsp;75km s prev&yacute;&scaron;en&iacute;m&nbsp;&nbsp;1800m.</p>\n\n<div>Hrozba z&nbsp;blatovej trate sa nenaplnila a&nbsp;tak pretek&aacute;ri pretekali na temer suchej trati . Trať bola temer totožn&aacute; s&nbsp;tou minuloročnou, až na nejak&eacute; povrchov&eacute; &uacute;pravy.</div>\n\n<p>Na 20 kilometrovom okruhu sa s časom 0:50:12 na prvom mieste umiestnil Filip Balciar, 44km &uacute;sek zvl&aacute;dol najr&yacute;chlej&scaron;ie Tom&aacute;&scaron; Vi&scaron;ňovsk&yacute; s časom 01:38:57 a&nbsp;na na 75km vyhral Ondrej Fojt&iacute;&shy;k s časom 2:57:41.</p>\n\n<p>V&scaron;etk&yacute;m v&iacute;ťazom gratulujeme, kompletn&eacute; v&yacute;sledky z&nbsp;podujat&iacute; n&aacute;jdete v&nbsp;sekcii v&yacute;sledky:&nbsp;<a href=\"http://www.zupnypohar.sk/vysledky\">http://www.zupnypohar.sk/vysledky</a></p>\n\n<p>Ďal&scaron;ie kolo Župn&eacute;ho poh&aacute;ra sa bude konať 24.5.201 v Bratislave, Karlovej Vsi, pod n&aacute;zvom Kaktusbike Bratislavsk&yacute; MTB marat&oacute;n&nbsp;</p>\n\n<p><a href=\"http://www.bratislavskymtbmaraton.sk/\" target=\"_blank\">http://www.bratislavskymtbmaraton.sk/</a></p>\n\n<p><strong>GAL&Eacute;RIE</strong></p>\n\n<p>Detsk&aacute; tour Petra Sagana:&nbsp;<a href=\"http://www.zupnypohar.sk/galeria/detska-tour-petra-sagana-sv-jur\" target=\"_blank\" title=\"\">www.zupnypohar.sk/galeria/detska-tour-petra-sagana-sv-jur</a><br />\nMtbiker:&nbsp;<a href=\"http://www.mtbiker.sk/clanky/6930/fotogaleria-specialized-svatojursky-mtb-maraton.html\" target=\"_blank\" title=\"\">www.mtbiker.sk/clanky/6930/fotogaleria-specialized-svatojursky-mtb-maraton.html</a><br />\nFaxCopy:&nbsp;<a href=\"http://hviezda.faxcopy.sk/akcie/1161/speialized-svatojursky-mtb-maraton-2014\" target=\"_blank\" title=\"\">hviezda.faxcopy.sk/akcie/1161/speialized-svatojursky-mtb-maraton-2014</a></p>\n","","","","","0","1","","0","58","0"),
(null,"15240","","1044","post","Technické zmeny","technicke-zmeny","0","0","","","3670","2019-03-18 15:26:55","2019-03-18 15:26:55","2014-03-31 11:00:00","0","","<p>Dobr&yacute; deň, ahojte.<br />\nDne&scaron;n&yacute;m dňom tesne pred Nov&yacute;m Rokom V&aacute;m d&aacute;vame do pozornosti p&aacute;r technick&yacute;ch zmien, ktor&eacute; sa t&yacute;kaj&uacute; Župn&eacute;ho Poh&aacute;ra 2015</p>\n\n<p><strong>1.)</strong><br />\nV&nbsp;prvom rade ide o&nbsp;prerobenie str&aacute;nky Župn&yacute; Poh&aacute;r, ktor&aacute; po dlhom čase pre&scaron;la programovou zmenou a&nbsp;je nap&iacute;san&aacute; pod redakčn&yacute;m syst&eacute;mom&nbsp;<strong>Designdnt</strong>. To znamen&aacute;, že&nbsp;<strong>star&eacute; url &nbsp;adresy už nebud&uacute; pravdepodobne fungovať</strong>. Tak isto aj v&scaron;etky zdielan&eacute; a lajkovan&eacute; čl&aacute;nky. Na pl&aacute;ne je postupn&eacute; roz&scaron;irovanie funkci webu a pril&aacute;kanie reklamy pre lep&scaron;ie fungovanie.</p>\n\n<p><strong>2.)&nbsp;</strong><br />\nStr&aacute;nka Bratislavsk&eacute;ho MTB marat&oacute;nu&nbsp;na Facebook-u zanikla (premenovala sa) na Župn&yacute; Poh&aacute;r.<br />\nJe zmenen&yacute; n&aacute;zov<strong>,&nbsp;</strong>&nbsp;aj&nbsp;<strong>URL adresa str&aacute;nky&nbsp;</strong>(<a href=\"http://www.facebook.com/zupnypohar\">www.facebook.com/zupnypohar</a>) Budeme veľmi radi, ak podpor&iacute;te propag&aacute;ciu Župn&eacute;ho Poh&aacute;ra aj tak&yacute;mto sp&ocirc;sobom, že po&scaron;lete pozvania na str&aacute;nku svoj&iacute;m priateľom bikerom. Budeme V&aacute;m vďačn&iacute;.&nbsp;<br />\n<br />\n<strong>3.)</strong><br />\nProstredn&iacute;ctvom&nbsp;<strong>Facebook-u &nbsp;</strong>a&nbsp;str&aacute;nky&nbsp;<strong>Župn&yacute; Poh&aacute;r&nbsp;</strong>budeme d&aacute;vať do pozornosti v&scaron;etky inform&aacute;cie t&yacute;kaj&uacute;ce sa podujat&iacute; &nbsp;a&nbsp;inform&aacute;cie&nbsp;<strong>o fotogal&eacute;riach z&nbsp;podujat&iacute;.&nbsp;</strong>Ak budeme mať k &nbsp;dispoz&iacute;cii podklady, budeme fotografie ukladať do na&scaron;ej internej gal&eacute;rie.</p>\n","","","","","0","1","","0","58","0"),
(null,"15241","","1044","post","Čo je nové?","co-je-nove","0","0","","","3671","2019-03-18 15:26:55","2019-03-18 15:26:55","2013-12-23 11:00:00","0","","<p><span style=\"color:rgb(17, 17, 17); font-family:arial,helvetica,sans-serif\">Seri&aacute;l pretekov Župn&yacute; poh&aacute;r 2015 nadv&auml;zuje na predo&scaron;l&eacute; &scaron;tyri &uacute;spe&scaron;n&eacute; ročn&iacute;ky zastre&scaron;ovan&eacute; Bratislavsk&yacute;m</span></p>\n\n<p>&nbsp;samospr&aacute;vnym krajom. Je to jedinečn&yacute; &scaron;portov&yacute; projekt, ktor&eacute;ho cieľom je nielen dobre si za&scaron;portovať a zas&uacute;ťažiť, ale svojou &uacute;časťou z&aacute;roveň podporiť a propagovať Bratislavsk&yacute; samospr&aacute;vny kraj. Župn&yacute; poh&aacute;r 2015 je určen&yacute; pre v&scaron;etk&yacute;ch milovn&iacute;kov cyklistiky, ktor&iacute; maj&uacute; radi akt&iacute;vny životn&yacute; &scaron;t&yacute;l a chc&uacute; niečo urobiť pre seba i pre in&yacute;ch.</p>\n","","","","","0","1","","0","58","0"),
